B.KY=new A.b8("                \u041a\u0430\u043d\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0441\u0432\u043e\u0439 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0437\u0430\u043a\u043e\u043d \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043e\u043c. \u042d\u0442\u043e \u0441\u0432\u044f\u0437\u0430\u043d\u043e \u0441 \u0442\u0435\u043c, \u0447\u0442\u043e \u0441\u0430\u043c \u0437\u0430\u043a\u043e\u043d \u043f\u0440\u043e\u0438\u0441\u0442\u0435\u043a\u0430\u0435\u0442 \u0438\u0437 \u0440\u0430\u0437\u0443\u043c\u0430, \u043d\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0443\u044e\u0442\u0441\u044f \u0438\u043c \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043e\u0431\u043b\u0430\u0434\u0430\u044e\u0442 \u0442\u0430\u043a\u0436\u0435 \u0438 \u0447\u0443\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u043e\u043d \u043d\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u0435\u0442 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u043e, \u043a\u0430\u043a, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0437\u0430\u043a\u043e\u043d\u044b \u0442\u044f\u0433\u043e\u0442\u0435\u043d\u0438\u044f \u0438\u043b\u0438 \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0440\u0435\u0430\u043a\u0446\u0438\u0439, \u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0432\u0435\u043b\u0435\u043d\u0438\u0435 (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0438\u0432), \u043f\u0440\u0435\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0449\u0435\u0435 \u043d\u0430\u043c \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u0438\u043b\u0438 \u043d\u0435\u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043f\u043e\u0441\u0442\u0443\u043f\u043a\u043e\u0432. \u041e\u0434\u043d\u0430\u043a\u043e \u0432\u0435\u043b\u0438\u0442 \u043e\u043d \u043d\u0430\u043c \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438, \u0442.\u0435. \u0431\u0435\u0437\u0443\u0441\u043b\u043e\u0432\u043d\u043e. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u041a\u0430\u043d\u0442 \u0438 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0435\u0433\u043e \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u043e\u043c. \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u0438\u0432\u044b \u0435\u0449\u0435 \u0431\u044b\u0432\u0430\u044e\u0442 \u0438 \u0443\u0441\u043b\u043e\u0432\u043d\u044b\u0435, \u043d\u043e \u0438\u0445 \u043c\u044b \u043d\u0435 \u0431\u0443\u0434\u0435\u043c \u0440\u0430\u0441\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u0442\u044c. \n                ",null,B.al,null,null,null)
B.KZ=new A.b8("\n                \u041a\u0430\u043d\u0442 \u0441\u0447\u0438\u0442\u0430\u043b, \u0447\u0442\u043e \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u044f \u043e\u0431\u044f\u0437\u0430\u043d\u0430 \u043e\u0442\u0432\u0435\u0442\u0438\u0442\u044c \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0443, \u043f\u043e \u043a\u0440\u0430\u0439\u043d\u0435\u0439 \u043c\u0435\u0440\u0435, \u043d\u0430 \u0447\u0435\u0442\u044b\u0440\u0435 \u0432\u043e\u043f\u0440\u043e\u0441\u0430. \u0422\u0440\u0438 \u0432\u043e\u043f\u0440\u043e\u0441\u0430 \u0441\u0444\u043e\u0440\u043c\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u044b \u0432 \xab\u041a\u0440\u0438\u0442\u0438\u043a\u0435 \u0447\u0438\u0441\u0442\u043e\u0433\u043e \u0440\u0430\u0437\u0443\u043c\u0430\xbb, \u0430 \u0432 \u043b\u0435\u043a\u0446\u0438\u044f\u0445 \u043f\u043e \u043b\u043e\u0433\u0438\u043a\u0435 \u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d \u0447\u0435\u0442\u0432\u0435\u0440\u0442\u044b\u0439. \n                \u041e\u043d\u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u043e\u0445\u0432\u0430\u0442\u044b\u0432\u0430\u044e\u0442 \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0433\u043e \u0434\u043b\u044f \u043d\u0430\u0441 \u0437\u043d\u0430\u043d\u0438\u044f \u0438 \u0441\u043f\u043e\u0441\u043e\u0431\u043e\u0432 \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0437\u0430 \u043f\u0440\u0435\u0434\u0435\u043b\u0430\u043c\u0438 \u0437\u043d\u0430\u043d\u0438\u044f, \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u043d\u0430\u0448\u0435\u0433\u043e \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0438 \u0442\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u044d\u0442\u0438\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043e\u0442\u043d\u043e\u0441\u044f\u0442\u0441\u044f \u043a \u0434\u043e\u043b\u0436\u043d\u043e\u043c\u0443, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043c\u043e\u0436\u0435\u0442 \u043f\u0440\u043e\u0438\u0441\u0442\u0435\u0447\u044c \u0438\u0437 \u043d\u0430\u0448\u0438\u0445 \u0434\u043e\u043b\u0436\u043d\u044b\u0445 (\u0438\u043b\u0438 \u043d\u0435 \u0434\u043e\u043b\u0436\u043d\u044b\u0445) \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439, \u0430, \u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0435\u0442 \u0442\u043e, \u043d\u0430 \u0447\u0442\u043e \u043c\u044b \u043c\u043e\u0436\u0435\u043c, \u0430 \u043d\u0430 \u0447\u0442\u043e \u043d\u0435 \u043c\u043e\u0436\u0435\u043c \u043d\u0430\u0434\u0435\u044f\u0442\u044c\u0441\u044f. \n                \n                ",null,null,null,null,null)
