B.L_=new A.b8("                \u0412\u0438\u0434\u0438\u043c\u043e, \u043d\u0430 \u0442\u0430\u043a\u043e\u043c \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0435 \u044d\u0442\u0438\u043a\u0438 \u041a\u0430\u043d\u0442\u0430 \u0441\u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c \u0438 \u0435\u0433\u043e \u0434\u0435\u0442\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u0435 \u0432 \u043f\u0438\u0435\u0442\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u0438, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043f\u0440\u0438\u0434\u0430\u0432\u0430\u043b\u0430 \u043a\u043e\u043b\u043e\u0441\u0441\u0430\u043b\u044c\u043d\u043e\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \u043d\u0435\u0443\u043a\u043e\u0441\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u043c\u0443 \u0441\u043e\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u044e \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0437\u0430\u043f\u043e\u0432\u0435\u0434\u0435\u0439 \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u043e\u0441\u043e\u0437\u043d\u0430\u043d\u043d\u044b\u0445 \u043c\u043e\u0442\u0438\u0432\u043e\u0432.\n                \u041e\u0434\u043d\u0430\u043a\u043e, \u044d\u0442\u0438\u043a\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e, \u043d\u0430\u0447\u0438\u043d\u0430\u044f \u0441 \u0410\u0440\u0438\u0441\u0442\u043e\u0442\u0435\u043b\u044f, \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u0430 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u043e \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0437\u0430\u043a\u043e\u043d\u0430\u0445, \u043d\u043e \u0438 \u043e \u0441\u0447\u0430\u0441\u0442\u044c\u0435. \u041a\u0430\u043d\u0442, \u043d\u0435\u0441\u043c\u043e\u0442\u0440\u044f \u043d\u0430 \u0432\u0441\u044e \u0441\u0432\u043e\u044e \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0441\u0442\u044c \u043d\u0430 \u044d\u0442\u0438\u043a\u0443 \u0434\u043e\u043b\u0433\u0430, \u0442\u0430\u043a\u0436\u0435 \u043d\u0435 \u043e\u0431\u043e\u0448\u0435\u043b \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435\u043c \u044d\u0442\u043e\u0442 \u0432\u043e\u043f\u0440\u043e\u0441, \u043f\u0440\u0430\u0432\u0434\u0430, \u043e\u043d \u0443 \u043d\u0435\u0433\u043e \u043d\u0430\u0445\u043e\u0434\u0438\u0442 \u0441\u0432\u043e\u0435\u043e\u0431\u0440\u0430\u0437\u043d\u043e\u0435 \u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435: \xab...\u043c\u043e\u0440\u0430\u043b\u044c... \u0435\u0441\u0442\u044c \u0443\u0447\u0435\u043d\u0438\u0435 \u043d\u0435 \u043e \u0442\u043e\u043c, \u043a\u0430\u043a \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u0441\u0435\u0431\u044f \u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432\u044b\u043c, \u0430 \u043e \u0442\u043e\u043c, \u043a\u0430\u043a \u043c\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u0441\u0442\u0430\u0442\u044c \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u044b\u043c\u0438 \u0441\u0447\u0430\u0441\u0442\u044c\u044f\xbb. \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e, \u0441\u0447\u0430\u0441\u0442\u044c\u0435 \u0438 \u0435\u0433\u043e \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0435 \u043d\u0435 \u043d\u0430\u0445\u043e\u0434\u044f\u0442\u0441\u044f \u0432 \u0440\u0443\u043a\u0430\u0445 \u0441\u0430\u043c\u043e\u0433\u043e \u0438\u043d\u0434\u0438\u0432\u0438\u0434\u0430 \u0438\u043b\u0438, \u043f\u043e \u043a\u0440\u0430\u0439\u043d\u0435\u0439 \u043c\u0435\u0440\u0435, \u043d\u0435 \u0441\u0432\u044f\u0437\u0430\u043d\u044b \u0432\u043f\u0440\u044f\u043c\u0443\u044e \u0441 \u0435\u0433\u043e \u043c\u043e\u0440\u0430\u043b\u044c\u044e. \u0411\u0443\u0434\u0435\u0442 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432 \u0438\u043b\u0438 \u043d\u0435\u0442, \u0437\u0430\u0432\u0438\u0441\u0438\u0442 \u043e\u0442 \u0438\u0433\u0440\u044b \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0445 \u0441\u0438\u043b \u043f\u0440\u0438\u0440\u043e\u0434\u044b (\u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439), \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0443\u043c\u0435\u043d\u0438\u044f \u0438 \u0434\u0430\u0436\u0435 \u0445\u0438\u0442\u0440\u043e\u0441\u0442\u0438: \xab\u0421\u0447\u0430\u0441\u0442\u044c\u0435 \u2014 \u044d\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0440\u0430\u0437\u0443\u043c\u043d\u043e\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u0432 \u043c\u0438\u0440\u0435, \u043a\u043e\u0433\u0434\u0430 \u0432\u0441\u0435 \u0432 \u0435\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0438 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u0441\u043e\u0433\u043b\u0430\u0441\u043d\u043e \u0435\u0433\u043e \u0432\u043e\u043b\u0435 \u0438 \u0436\u0435\u043b\u0430\u043d\u0438\u044e\xbb. \u041e\u0447\u0435\u0432\u0438\u0434\u043d\u043e, \u0447\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u0442\u0440\u0443\u0434\u043d\u043e \u0434\u043e\u0441\u0442\u0438\u0436\u0438\u043c\u043e. \u041e\u0434\u043d\u0430\u043a\u043e, \u0447\u0442\u043e \u0432 \u0441\u0438\u043b\u0430\u0445 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u0447\u0442\u043e \u043d\u0430\u043f\u0440\u044f\u043c\u0443\u044e \u0441\u0432\u044f\u0437\u0430\u043d\u043e \u0441 \u0435\u0433\u043e \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c\u044e \u2014 \u044d\u0442\u043e \u0431\u044b\u0442\u044c \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u044b\u043c \u0441\u0447\u0430\u0441\u0442\u044c\u044f. \u0411\u044b\u0442\u044c \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u044b\u043c \u0441\u0447\u0430\u0441\u0442\u044c\u044f \u2014 \u043f\u0440\u044f\u043c\u043e\u0435 \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435 \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u041c\u044b \u0438\u043d\u043e\u0433\u0434\u0430 \u0442\u0430\u043a \u0438 \u0433\u043e\u0432\u043e\u0440\u0438\u043c \u043e \u043b\u044e\u0434\u044f\u0445: \xab\u041e\u043d \u0434\u043e\u0441\u0442\u043e\u0438\u043d \u0441\u0447\u0430\u0441\u0442\u044c\u044f \u0438\u043b\u0438 \u043e\u043d \u043d\u0435 \u0434\u043e\u0441\u0442\u043e\u0438\u043d \u0441\u0447\u0430\u0441\u0442\u044c\u044f\xbb, \u0438\u043c\u0435\u044f \u0432 \u0432\u0438\u0434\u0443, \u0447\u0442\u043e \u043e\u0431\u0440\u0430\u0437 \u0436\u0438\u0437\u043d\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438\u043c\u0435\u0435\u0442 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440, \u0438 \u0442\u0430\u043a\u043e\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u0442\u044c \u0432\u043e\u0437\u043d\u0430\u0433\u0440\u0430\u0436\u0434\u0435\u043d \u0441\u0447\u0430\u0441\u0442\u044c\u0435\u043c. \u0422\u0435\u043c \u043d\u0435 \u043c\u0435\u043d\u0435\u0435, \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u044c \u0431\u044b\u0442\u044c \u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432\u044b\u043c, \u043f\u043e \u041a\u0430\u043d\u0442\u0443, \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0432\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u043c \u0431\u043b\u0430\u0433\u043e\u043c \u043a\u0430\u043a \u043f\u0435\u0440\u0432\u043e\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u044b\u043c \xab\u0443\u0441\u043b\u043e\u0432\u0438\u0435\u043c \u0432\u0441\u0435\u0433\u043e \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u043c\u043e\u0436\u0435\u0442 \u043a\u0430\u0437\u0430\u0442\u044c\u0441\u044f \u043d\u0430\u043c \u0436\u0435\u043b\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u043c, \u0441\u0442\u0430\u043b\u043e \u0431\u044b\u0442\u044c, \u0438 \u0432\u0441\u0435\u0445 \u043d\u0430\u0448\u0438\u0445 \u043f\u043e\u0438\u0441\u043a\u043e\u0432 \u0441\u0447\u0430\u0441\u0442\u044c\u044f\xbb.\n                \u041e\u0434\u043d\u0430\u043a\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u044d\u0442\u0438\u043c, \u043a\u0430\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u043d\u0435 \u0443\u0434\u043e\u0432\u043b\u0435\u0442\u0432\u043e\u0440\u044f\u0435\u0442\u0441\u044f. \u0415\u043c\u0443 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u0430 \u0431\u043e\u043b\u0435\u0435 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0441\u0432\u044f\u0437\u044c \u043c\u0435\u0436\u0434\u0443 \u0434\u043e\u0431\u0440\u043e\u0434\u0435\u0442\u0435\u043b\u044c\u044e \u0438 \u0441\u0447\u0430\u0441\u0442\u044c\u0435\u043c. \u041e\u0434\u043d\u0430\u043a\u043e \u0437\u0434\u0435\u0441\u044c \u043c\u044b \u0443\u0436\u0435 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0438\u043c \u043a \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0438\u044e \u0442\u0440\u0435\u0442\u044c\u0435\u0433\u043e \u0432\u043e\u043f\u0440\u043e\u0441\u0430.\n                \n                ",null,null,null,null,null)
B.L0=new A.b8("                \u041e\u0442\u0432\u0435\u0447\u0430\u044f \u043d\u0430 \u0432\u043e\u043f\u0440\u043e\u0441 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u0430 \u0426\u0451\u043b\u044c\u043d\u0435\u0440\u0430 \xab\u0427\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435?\xbb, \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u0431\u0435\u0440\u043b\u0438\u043d\u0441\u043a\u0438\u0439 \u0444\u0438\u043b\u043e\u0441\u043e\u0444 \u041c\u043e\u0437\u0435\u0441 \u041c\u0435\u043d\u0434\u0435\u043b\u044c\u0441\u043e\u043d \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e \u0437\u0430 \u043c\u0435\u0441\u044f\u0446 \u0434\u043e \u043f\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u044f \u0441\u0442\u0430\u0442\u044c\u0438 \u041a\u0430\u043d\u0442\u0430 \u043e \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0438 \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u0441\u0442\u0430\u0442\u044c\u044e \xab\u041e \u0432\u043e\u043f\u0440\u043e\u0441\u0435: \u0447\u0442\u043e \u0437\u043d\u0430\u0447\u0438\u0442 \u0431\u044b\u0442\u044c \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u043d\u044b\u043c?\xbb. \u0412 \u0441\u0442\u0430\u0442\u044c\u0435 \u043e\u043d \u0432\u0432\u043e\u0434\u0438\u0442 \u0442\u0440\u0438 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u043d\u044f\u0442\u0438\u044f: \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435, \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0430, \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u0435, \u0438 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u0435\u0442, \u0447\u0442\u043e \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0430 \u2014 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u0432\u0438\u0434\u044b \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f. \u041f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u2014 \u044d\u0442\u043e \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u0435 \u0432 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u043b\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0435 \u043a\u0430\u043a \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044e. \u0414\u0435\u043b\u0430\u044f \u0430\u043a\u0446\u0435\u043d\u0442 \u043d\u0430 \u0442\u0435\u043e\u0440\u0438\u044e, \u041c\u0435\u043d\u0434\u0435\u043b\u044c\u0441\u043e\u043d \u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u043b \u0432 \u0434\u0443\u0445\u0435 \u043e\u0431\u044b\u0447\u043d\u044b\u0445 \u043f\u0440\u043e\u0441\u0432\u0435\u0442\u0438\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0445 \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0438\u0439, \u043e\u0442\u043e\u0436\u0434\u0435\u0441\u0442\u0432\u043b\u044f\u044f \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u0441 \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0435\u043d\u0438\u0435\u043c \u043d\u0430\u0443\u043a\u0438 \u0438 \u0437\u043d\u0430\u043d\u0438\u0439 \u0432\u043e\u043e\u0431\u0449\u0435. \u0421\u0443\u0431\u044a\u0435\u043a\u0442\u043e\u043c \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f, \u043f\u043e \u041c\u0435\u043d\u0434\u0435\u043b\u044c\u0441\u043e\u043d\u0443, \u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430\u0446\u0438\u044f, \u043e\u043d \u0432\u0435\u0437\u0434\u0435 \u0433\u043e\u0432\u043e\u0440\u0438\u0442 \u043e \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0438 \u043d\u0430\u0446\u0438\u0438.\n                ",null,null,null,null,null)
B.L1=new A.b8("                \u041c\u043e\u0440\u0430\u043b\u044c \u043d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u0430 \u0431\u0435\u0437 \u0441\u0432\u043e\u0431\u043e\u0434\u044b. \u0415\u0441\u043b\u0438 \u043c\u044b \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u043c, \u0447\u0442\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0435 \u0441\u0432\u043e\u0431\u043e\u0434\u0435\u043d, \u0435\u0441\u043b\u0438, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0432\u0441\u0435 \u0435\u0433\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u044b \u0432\u043e\u043b\u0435\u0439 \u0411\u043e\u0433\u0430 \u0438\u043b\u0438 \u0437\u0430\u043a\u043e\u043d\u043e\u043c\u0435\u0440\u043d\u043e\u0441\u0442\u044c\u044e \u043f\u0440\u0438\u0440\u043e\u0434\u044b, \u0442\u043e \u043d\u0435\u043b\u044c\u0437\u044f \u0433\u043e\u0432\u043e\u0440\u0438\u0442\u044c \u043e \u043c\u043e\u0440\u0430\u043b\u0438 \u0438\u043b\u0438 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u0442\u043e\u0433\u0434\u0430 \u043d\u0435\u0442 \u043c\u0435\u0441\u0442\u0430 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0441\u0432\u043e\u0431\u043e\u0434\u0430 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0439 \u043f\u0440\u0435\u0434\u043f\u043e\u0441\u044b\u043b\u043a\u043e\u0439 \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438.\n                \u041a\u0430\u043d\u0442 \u043f\u043e\u043b\u0430\u0433\u0430\u043b, \u0447\u0442\u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0432 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u043c\u043e\u0433\u0443\u0442 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u0442\u044c\u0441\u044f \u0442\u0440\u0435\u043c\u044f \u0444\u0430\u043a\u0442\u043e\u0440\u0430\u043c\u0438: \u0434\u043e\u043b\u0433\u043e\u043c, \u0441\u043a\u043b\u043e\u043d\u043d\u043e\u0441\u0442\u044c\u044e \u0438 \u0441\u0442\u0440\u0430\u0445\u043e\u043c. \u0414\u043e\u043b\u0433 \u2014 \u044d\u0442\u043e \u0432\u044b\u0442\u0435\u043a\u0430\u044e\u0449\u0435\u0435 \u0438\u0437 \u0440\u0430\u0437\u0443\u043c\u0430 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u0435, \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u044e\u0449\u0435\u0435 \u043d\u0430\u0448\u0438 \u043e\u0431\u044f\u0437\u0430\u043d\u043d\u043e\u0441\u0442\u0438 \u043f\u043e \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044e \u043a \u0441\u0430\u043c\u043e\u043c\u0443 \u0441\u0435\u0431\u0435 \u0438 \u0434\u0440\u0443\u0433\u0438\u043c \u043b\u044e\u0434\u044f\u043c, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043a \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0443 \u0432 \u0446\u0435\u043b\u043e\u043c. \u0421\u043a\u043b\u043e\u043d\u043d\u043e\u0441\u0442\u044c \u2014 \u044d\u0442\u043e \u043f\u043e\u0442\u0440\u0435\u0431\u043d\u043e\u0441\u0442\u044c, \u0443\u0434\u043e\u0432\u043b\u0435\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u0438\u043d\u043e\u0441\u0438\u0442 \u043d\u0430\u043c \u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u0435 \u0438\u043b\u0438 \u043f\u043e\u043b\u044c\u0437\u0443. \u0421\u0442\u0440\u0430\u0445 \u2014 \u0447\u0443\u0432\u0441\u0442\u0432\u043e, \u0433\u043e\u0432\u043e\u0440\u044f\u0449\u0435\u0435 \u043d\u0430\u043c, \u0447\u0442\u043e \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435\u043c \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u044e\u0449\u0435\u0433\u043e\u0441\u044f \u0441\u043e\u0431\u044b\u0442\u0438\u044f \u0431\u0443\u0434\u0435\u0442 \u043d\u0435\u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u0435 \u0438\u043b\u0438 \u0432\u0440\u0435\u0434.\n                \u0414\u043e \u041a\u0430\u043d\u0442\u0430 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u044b \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u043b\u0438 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438: \u0447\u0443\u0432\u0441\u0442\u0432\u0430, \u0431\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0443\u044e \u0432\u043e\u043b\u044e, \u0437\u0430\u043a\u043e\u043d \u043f\u0440\u0438\u0440\u043e\u0434\u044b, \u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u0435 \u043a \u0441\u0447\u0430\u0441\u0442\u044c\u044e, \u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u0435 \u043a \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c\u0443 \u043f\u043e\u0440\u044f\u0434\u043a\u0443. \u041a\u0430\u043d\u0442 \u0432\u043d\u0435\u0441 \u043d\u043e\u0432\u043e\u0435 \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u2014 \u043e\u043d \u0441\u0447\u0438\u0442\u0430\u043b, \u0447\u0442\u043e \u0440\u0430\u0437\u0443\u043c \u0441\u0430\u043c\u043e\u0437\u0430\u043a\u043e\u043d\u0435\u043d (\u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0435\u043d), \u0430, \u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u0432 \u0441\u0432\u043e\u0435\u043c \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u0438 \u0441\u0430\u043c \u0434\u0430\u0435\u0442 \u0437\u0430\u043a\u043e\u043d\u044b \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0438\u0445 \u043f\u043e\u0441\u0442\u0443\u043f\u043a\u043e\u0432.\n                \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e, \u043f\u043e \u041a\u0430\u043d\u0442\u0443, \u043f\u043e\u0432\u0438\u043d\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0433\u043e\u043b\u043e\u0441\u0443 \u0440\u0430\u0437\u0443\u043c\u0430, \u0430 \u044d\u0442\u043e \u0438 \u0435\u0441\u0442\u044c \u0434\u043e\u043b\u0433: \xab\u0414\u043e\u043b\u0433! \u0422\u044b \u0432\u043e\u0437\u0432\u044b\u0448\u0435\u043d\u043d\u043e\u0435, \u0432\u0435\u043b\u0438\u043a\u043e\u0435 \u0441\u043b\u043e\u0432\u043e, \u0432 \u0442\u0435\u0431\u0435 \u043d\u0435\u0442 \u043d\u0438\u0447\u0435\u0433\u043e \u043f\u0440\u0438\u044f\u0442\u043d\u043e\u0433\u043e, \u0447\u0442\u043e \u043b\u044c\u0441\u0442\u0438\u043b\u043e \u0431\u044b \u043b\u044e\u0434\u044f\u043c, \u0442\u044b \u0442\u0440\u0435\u0431\u0443\u0435\u0448\u044c \u043f\u043e\u0434\u0447\u0438\u043d\u0435\u043d\u0438\u044f, \u0445\u043e\u0442\u044f, \u0447\u0442\u043e\u0431\u044b \u043f\u0440\u043e\u0431\u0443\u0434\u0438\u0442\u044c \u0432\u043e\u043b\u044e, \u0442\u044b \u043d\u0435 \u0443\u0433\u0440\u043e\u0436\u0430\u0435\u0448\u044c \u0442\u0435\u043c, \u0447\u0442\u043e \u0432\u043d\u0443\u0448\u0430\u043b\u043e \u0431\u044b \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0442\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0432 \u0434\u0443\u0448\u0435 \u0438 \u043f\u0443\u0433\u0430\u043b\u043e \u0431\u044b; \u0442\u044b \u0442\u043e\u043b\u044c\u043a\u043e \u0443\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u0435\u0448\u044c \u0437\u0430\u043a\u043e\u043d, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0441\u0430\u043c \u0441\u043e\u0431\u043e\u0439 \u043f\u0440\u043e\u043d\u0438\u043a\u0430\u0435\u0442 \u0432 \u0434\u0443\u0448\u0443 \u0438 \u0434\u0430\u0436\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 \u0432\u043e\u043b\u0438 \u043c\u043e\u0436\u0435\u0442 \u0441\u043d\u0438\u0441\u043a\u0430\u0442\u044c \u0443\u0432\u0430\u0436\u0435\u043d\u0438\u0435 \u043a \u0441\u0435\u0431\u0435 (\u0445\u043e\u0442\u044f \u0438 \u043d\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0435); \u043f\u0435\u0440\u0435\u0434 \u0442\u043e\u0431\u043e\u0439 \u0437\u0430\u043c\u043e\u043b\u043a\u0430\u044e\u0442 \u0432\u0441\u0435 \u0441\u043a\u043b\u043e\u043d\u043d\u043e\u0441\u0442\u0438, \u0445\u043e\u0442\u044f \u0431\u044b \u043e\u043d\u0438 \u0442\u0435\u0431\u0435 \u0432\u0442\u0430\u0439\u043d\u0435 \u0438 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438...\xbb.\n                \u041a\u0430\u043d\u0442 \u043e\u0442\u0434\u0430\u0435\u0442 \u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043c\u0435\u0441\u0442\u043e \u0432 \u0441\u0432\u043e\u0435\u0439 \u044d\u0442\u0438\u043a\u0435 \u043f\u043e\u043d\u044f\u0442\u0438\u044e \u0434\u043e\u043b\u0433\u0430, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u0435\u0433\u043e \u044d\u0442\u0438\u043a\u0443 \u0447\u0430\u0441\u0442\u043e \u043d\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u044d\u0442\u0438\u043a\u043e\u0439 \u0434\u043e\u043b\u0433\u0430.\n                \u041a\u0430\u043d\u0442 \u0441\u0447\u0438\u0442\u0430\u043b, \u0447\u0442\u043e \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043f\u043e\u0441\u0442\u0443\u043f\u043a\u0438, \u0441\u043e\u0432\u0435\u0440\u0448\u0430\u0435\u043c\u044b\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0438\u0437 \u0443\u0432\u0430\u0436\u0435\u043d\u0438\u044f \u043a \u0434\u043e\u043b\u0433\u0443. \u0412\u0430\u0436\u043d\u0443\u044e \u0440\u043e\u043b\u044c \u0437\u0434\u0435\u0441\u044c \u0438\u0433\u0440\u0430\u0435\u0442 \u0441\u043b\u043e\u0432\u043e \xab\u0442\u043e\u043b\u044c\u043a\u043e\xbb. \u0415\u0441\u043b\u0438 \u043f\u043e\u0441\u0442\u0443\u043f\u043e\u043a \u0441\u043e\u043e\u0431\u0440\u0430\u0437\u0435\u043d \u0434\u043e\u043b\u0433\u0443, \u043a\u0430\u043a \u0433\u043e\u0432\u043e\u0440\u0438\u0442 \u041a\u0430\u043d\u0442, \u043d\u043e \u0442\u0430\u043a\u0436\u0435 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0438 \u043d\u0430\u0448\u0435\u0439 \u0441\u043a\u043b\u043e\u043d\u043d\u043e\u0441\u0442\u0438, \u0442\u043e \u044d\u0442\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u0435\u0442, \u0447\u0442\u043e \u043e\u043d \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c. \u041d\u043e \u0442\u0430\u043a\u043e\u0439 \u043f\u043e\u0441\u0442\u0443\u043f\u043e\u043a \u043d\u0435 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0438 \u0431\u0435\u0437\u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u043e\u043d \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u0434\u043e\u043b\u0433\u0443. \u041a\u0430\u043d\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0442\u0430\u043a\u043e\u0439 \u043f\u043e\u0441\u0442\u0443\u043f\u043e\u043a \u0435\u0433\u043e \u043b\u0435\u0433\u0430\u043b\u044c\u043d\u044b\u043c, \u0442.\u0435. \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u043c \u0437\u0430\u043a\u043e\u043d\u0443, \u043d\u043e \u043d\u0435 \u0438\u043c\u0435\u044e\u0449\u0438\u043c \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f.\n                ",null,null,null,null,null)
B.L2=new A.b8("                \u041e\u0442\u0441\u044e\u0434\u0430 \u0432\u043e\u0437\u043d\u0438\u043a\u0430\u0435\u0442 \u0433\u043b\u0430\u0432\u043d\u0430\u044f \u0434\u043b\u044f \u041a\u0430\u043d\u0442\u0430 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430: \u043a\u0430\u043a\u043e\u0432 \u0442\u043e\u0442 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043c\u0435\u0445\u0430\u043d\u0438\u0437\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 \u0434\u043e\u0431\u0438\u0442\u044c\u0441\u044f \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f? \u0418 \u043e\u0442\u0432\u0435\u0442 \u041a\u0430\u043d\u0442\u0430 \u043d\u0430 \u044d\u0442\u043e\u0442 \u0432\u043e\u043f\u0440\u043e\u0441 \u043f\u0440\u043e\u0441\u0442: \xab\u041f\u0443\u0431\u043b\u0438\u043a\u0430 \u0441\u0430\u043c\u0430 \u0441\u0435\u0431\u044f \u043f\u0440\u043e\u0441\u0432\u0435\u0442\u0438\u0442, \u0435\u0441\u043b\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u0435\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u0443\xbb. \u0422\u043e\u0433\u0434\u0430 \u0434\u0430\u0436\u0435 \u0441\u0440\u0435\u0434\u0438 \u043e\u043f\u0435\u043a\u0443\u043d\u043e\u0432, \u043f\u043e\u044f\u0432\u044f\u0442\u0441\u044f \u043b\u044e\u0434\u0438 \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u044b\u0435 \u043a \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044e. \u041a\u043e\u043d\u0435\u0447\u043d\u043e, \u0441\u043a\u0430\u0436\u0435\u0442 \u0447\u0438\u0442\u0430\u0442\u0435\u043b\u044c, \u044d\u0442\u043e \u2014 \u043f\u0440\u043e\u0441\u0442\u043e\u0439 \u0440\u0435\u0446\u0435\u043f\u0442, \u043d\u043e \u043a\u0442\u043e \u0436\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u0442\u0430\u043a \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u0438\u0442 \u043f\u0443\u0431\u043b\u0438\u043a\u0435 \u0441\u0432\u043e\u0431\u043e\u0434\u0443. \u041b\u044e\u0434\u0438 \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u043e\u0440\u043e\u0442\u044c\u0441\u044f \u0437\u0430 \u0441\u0432\u043e\u0438 \u043f\u0440\u0430\u0432\u0430, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e\u043c \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438. \u042d\u0442\u043e \u0443\u0431\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u0440\u0430\u0441\u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u044f\u043b\u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0438 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f. \u041d\u0430 \u044d\u0442\u043e \u041a\u0430\u043d\u0442 \u043e\u0442\u0432\u0435\u0447\u0430\u0435\u0442: \xab\u2026\u041d\u0438\u043a\u0430\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f \u043d\u0435 \u043c\u043e\u0436\u0435\u0442 \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u044c \u0438\u0441\u0442\u0438\u043d\u043d\u0443\u044e \u0440\u0435\u0444\u043e\u0440\u043c\u0443 \u043e\u0431\u0440\u0430\u0437\u0430 \u043c\u044b\u0441\u043b\u0435\u0439\xbb. \u0414\u043b\u044f \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f \u0442\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \xab\u0442\u043e\u043b\u044c\u043a\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u0430, \u0438 \u043f\u0440\u0438\u0442\u043e\u043c \u0441\u0430\u043c\u0430\u044f \u0431\u0435\u0437\u043e\u0431\u0438\u0434\u043d\u0430\u044f, \u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u0430 \u0432\u043e \u0432\u0441\u0435\u0445 \u0441\u043b\u0443\u0447\u0430\u044f\u0445 \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u043e \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0440\u0430\u0437\u0443\u043c\u043e\u043c\xbb.\n                \u042d\u0442\u043e \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043e\u0441\u043c\u0435\u043b\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u0432\u043e\u0438\u043c \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0440\u0430\u0437\u0443\u043c\u043e\u043c, \u0435\u0441\u0442\u044c \u0446\u0435\u043b\u044c \u0432\u0441\u0435\u0445 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0438 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0443\u0441\u0438\u043b\u0438\u0439. \u041a\u043e\u043d\u0435\u0447\u043d\u043e, \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044f\u044f \u0441\u0432\u043e\u0431\u043e\u0434\u0430, \u0434\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u043c\u0430\u044f \u043d\u0430 \u0442\u0430\u043a\u043e\u043c \u043f\u0443\u0442\u0438, \u0442\u0440\u0435\u0431\u0443\u0435\u0442 \u0432\u043d\u0435\u0448\u043d\u0438\u0445 \u0443\u0441\u043b\u043e\u0432\u0438\u0439 \u2014 \xab\u0431\u0435\u0437\u043e\u0431\u0438\u0434\u043d\u043e\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0441\u043b\u043e\u0432\u0430\xbb, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0434\u043e\u043b\u0436\u043d\u0430 \u0431\u044b\u0442\u044c \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0430 \u0432 \u0441\u0432\u043e\u0438\u0445 \u0432\u043d\u0435\u0448\u043d\u0438\u0445 \u043f\u0440\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u044f\u0445 \u0441\u0432\u043e\u0431\u043e\u0434\u043e\u0439 \u0434\u0440\u0443\u0433\u0438\u0445 \u043b\u044e\u0434\u0435\u0439. \u0412\u043c\u0435\u0441\u0442\u0435 \u0441 \u0442\u0435\u043c \u0431\u0435\u0437\u0433\u0440\u0430\u043d\u0438\u0447\u043d\u0430\u044f \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044f\u044f \u0441\u0432\u043e\u0431\u043e\u0434\u0430, \u0434\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u043c\u0430\u044f \u043d\u0430 \u043f\u0443\u0442\u0438 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f, \u0441\u043e\u0432\u043f\u0430\u0434\u0430\u0435\u0442 \u0441 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0437\u0430\u043a\u043e\u043d\u043e\u043c \u2014 \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0437\u0430\u043a\u043e\u043d\u043e\u043c \u0441\u0432\u043e\u0431\u043e\u0434\u044b. \u0414\u0435\u043b\u043e \u0432 \u0442\u043e\u043c, \u0447\u0442\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0440\u0430\u0437\u0443\u043c\u0430, \u043f\u043e \u041a\u0430\u043d\u0442\u0443, \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u0442 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u043a \u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044e \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c\u0443 \u0437\u0430\u043a\u043e\u043d\u0443, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u044d\u0442\u043e\u0442 \u0437\u0430\u043a\u043e\u043d \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u043c \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435\u043c \u0441\u0430\u043c\u043e\u0433\u043e \u0440\u0430\u0437\u0443\u043c\u0430. \u0412 \u044d\u0442\u043e\u043c \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0438 \u2014 \u0440\u0430\u0437\u0433\u0430\u0434\u043a\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f, \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u043d\u043e\u0439 \u041a\u0430\u043d\u0442\u043e\u043c \u0432 \u0442\u0440\u0430\u043a\u0442\u0430\u0442\u0435 \xab\u041e \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0435\xbb. \u041f\u043e\u0434\u043b\u0438\u043d\u043d\u043e\u0435 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u0435 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u0442\u043e\u043b\u044c\u043a\u043e \u0442\u043e\u0433\u0434\u0430, \u043a\u043e\u0433\u0434\u0430 \u043c\u044b, \u043e\u0431\u0435\u0440\u0435\u0433\u0430\u044f \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u043e\u0442 \u043b\u0435\u0442\u0430\u043b\u044c\u043d\u044b\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0439 \u043a\u043e\u043d\u0442\u0430\u043a\u0442\u0430 \u0441 \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u043e\u0439 \u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0441\u0440\u0435\u0434\u043e\u0439 \u0438 \u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u043e \u043f\u0440\u0438\u0443\u0447\u0430\u044f \u0435\u0433\u043e \u0441\u0447\u0438\u0442\u0430\u0442\u044c\u0441\u044f \u0441 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u043c\u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f\u043c\u0438, \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u0435\u043c \u0432 \u043d\u0435\u043c \u0437\u0430\u043f\u0430\u0441 \u0441\u0432\u043e\u0431\u043e\u0434\u044b, \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u044b\u0439 \u0434\u043b\u044f \u043f\u0440\u043e\u0431\u0443\u0436\u0434\u0435\u043d\u0438\u044f \u0432 \u043d\u0435\u043c \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0437\u0430\u043a\u043e\u043d\u0430. \u0418 \u0446\u0435\u043b\u044c \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f, \u0432\u043e-\u043f\u0435\u0440\u0432\u044b\u0445, \u043d\u0435 \u043c\u0435\u0448\u0430\u0442\u044c \u044d\u0442\u043e\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u0435, \u0430, \u0432\u043e-\u0432\u0442\u043e\u0440\u044b\u0445, \u043e\u0447\u0435\u043d\u044c \u043e\u0441\u0442\u043e\u0440\u043e\u0436\u043d\u043e \u0441\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u043f\u0440\u043e\u0431\u0443\u0436\u0434\u0435\u043d\u0438\u044e \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0437\u0430\u043a\u043e\u043d\u0430, \u0431\u043e\u043b\u044c\u0448\u0435\u0439 \u0447\u0430\u0441\u0442\u044c\u044e \u043f\u0440\u0438 \u043f\u043e\u043c\u043e\u0449\u0438 \u043d\u0435\u043d\u0430\u0432\u044f\u0437\u0447\u0438\u0432\u044b\u0445 \u043f\u0440\u0438\u043c\u0435\u0440\u043e\u0432. \u0422\u043e\u043b\u044c\u043a\u043e \u0432 \u0442\u0430\u043a\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \u043d\u0430\u043c \u0443\u0434\u0430\u0441\u0442\u0441\u044f \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u044c \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0433\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u043f\u043e\u043b\u0435\u0437\u043d\u043e\u0433\u043e \u0447\u043b\u0435\u043d\u0430 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430. \u0412\u0441\u0435 \u043d\u0430\u0448\u0438 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u043d\u0430\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0438 \u043f\u043e\u0443\u0447\u0435\u043d\u0438\u044f, \u043a\u0430\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u0432\u0435\u0434\u0443\u0442 \u043a \u043e\u0431\u0440\u0430\u0442\u043d\u043e\u043c\u0443 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0443. \u041a \u043d\u0435\u043c\u0443 \u0436\u0435 \u0432\u0435\u0434\u0443\u0442 \u0438 \u043c\u043d\u043e\u0433\u043e\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u0435 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f, \u043e\u0431\u044b\u0447\u043d\u043e \u043d\u0430\u0432\u044f\u0437\u044b\u0432\u0430\u0435\u043c\u044b\u0435 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044f\u043c\u0438 \u0432\u043e\u0441\u043f\u0438\u0442\u0443\u0435\u043c\u044b\u043c. \u041f\u0435\u0440\u0435\u0444\u0440\u0430\u0437\u0438\u0440\u0443\u044f \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0438\u0432 \u041a\u0430\u043d\u0442\u0430, \u043c\u043e\u0436\u043d\u043e \u0441\u043a\u0430\u0437\u0430\u0442\u044c, \u0447\u0442\u043e \u0434\u0435\u0432\u0438\u0437 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044f \u2014 \xab\u043f\u043e\u0441\u0442\u0443\u043f\u0430\u0439 \u0442\u0430\u043a, \u0447\u0442\u043e\u0431\u044b \u0432 \u043b\u0438\u0446\u0435 \u0440\u0435\u0431\u0435\u043d\u043a\u0430 \u0442\u044b \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u0438\u0434\u0435\u043b \u0442\u0430\u043a\u0436\u0435 \u0438 \u0446\u0435\u043b\u044c, \u0438 \u043d\u0438\u043a\u043e\u0433\u0434\u0430 \u0442\u043e\u043b\u044c\u043a\u043e \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e (\u0434\u043b\u044f \u0441\u0435\u0431\u044f, \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430, \u0438\u043b\u0438 \u0434\u0430\u0436\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430)\xbb. \u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u0441\u0432\u0435\u0442\u0435 \u044d\u0442\u0438\u0445 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0439 \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u0440\u0430\u0441\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u0442\u044c \u043c\u043d\u043e\u0433\u043e\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u0435 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0438\u0438 \u041a\u0430\u043d\u0442\u0430 \u043f\u043e \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0438 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044e.\n                \u041f\u0440\u043e\u0431\u043b\u0435\u043c\u0435 \u043e\u0442\u0441\u0442\u0430\u0438\u0432\u0430\u043d\u0438\u044f \u0431\u0435\u0437\u043e\u0431\u0438\u0434\u043d\u043e\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0441\u043b\u043e\u0432\u0430 \u043a\u0430\u043a \u0434\u0432\u0438\u0436\u0443\u0449\u0435\u0439 \u0441\u0438\u043b\u044b \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d \u0438 \xab\u0421\u043f\u043e\u0440 \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u043e\u0432\xbb. \u0421\u043f\u043e\u0440 \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u043e\u0432 \u2014 \u0438\u043c\u0435\u043d\u043d\u043e \u043e\u0431 \u044d\u0442\u043e\u043c. \u0424\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u0438\u0439 \u2014 \xab\u043d\u0438\u0437\u0448\u0438\u0439\xbb \u2014 \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u043c \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435 XVIII \u0432\u0435\u043a\u0430 \u0441\u043e\u0441\u0440\u0435\u0434\u043e\u0442\u043e\u0447\u0438\u0432\u0430\u043b\u0438\u0441\u044c \u0432\u0441\u0435 \u043d\u0430\u0443\u0447\u043d\u044b\u0435 \u0434\u0438\u0441\u0446\u0438\u043f\u043b\u0438\u043d\u044b, \u0431\u044b\u043b \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u043c \u0440\u0430\u0437\u0443\u043c\u0430, \u043d\u0443\u0436\u0434\u0430\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u0432 \u0441\u0432\u043e\u0431\u043e\u0434\u0435. \u041e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f \u044d\u0442\u043e\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u043b\u0438 \u043e\u0442 \u0441\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0438 \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u043c\u043e\u0439 \u0432 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435 \u0432\u044b\u0441\u0448\u0438\u043c\u0438 \u2014 \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0438 \u0442\u0435\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u0430\u043c\u0438. \u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u043d\u0430\u0443\u0447\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0443\u043c\u0430, \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c\u0430\u044f \u0441 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430\u043c\u0438, \u0441 \u043e\u0434\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u0438 \u0438\u0441\u0442\u0438\u043d\u0430\u043c\u0438 \u0440\u0435\u043b\u0438\u0433\u0438\u0438, \u0441 \u0434\u0440\u0443\u0433\u043e\u0439, \u2014 \u0432\u043e\u0442 \u0442\u0435\u043c\u0430 \u041a\u0430\u043d\u0442\u0430, \u0437\u0430\u0448\u0438\u0444\u0440\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\u043c\u0438 \u043c\u0435\u0436\u0434\u0443 \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u0430\u043c\u0438. \u0412 \u0440\u0430\u043c\u043a\u0430\u0445 \u0440\u0435\u0448\u0435\u043d\u0438\u044f \u044d\u0442\u043e\u0439 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u044b \u0437\u0430\u0440\u043e\u0436\u0434\u0430\u0435\u0442\u0441\u044f \u043d\u043e\u0432\u0430\u044f \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0438\u044f \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430, \u0440\u0430\u0437\u0432\u0438\u0442\u0430\u044f \u0438 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u0440\u0435\u0430\u043b\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c\u043e\u043c \u0444\u043e\u043d \u0413\u0443\u043c\u0431\u043e\u043b\u044c\u0434\u0442\u043e\u043c. \u0413\u043b\u0430\u0432\u043d\u043e\u0439 \u0438\u0434\u0435\u0435\u0439 \u0413\u0443\u043c\u0431\u043e\u043b\u044c\u0434\u0442\u0430 \u0431\u044b\u043b\u0430 \u0442\u0430\u043a\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430 \u0432\u044b\u0441\u0448\u0438\u0445 \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u044f\u0445 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 \u043d\u0430\u0443\u043a\u0438. \u042d\u0442\u0430 \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0438\u044f \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430 \u043a\u0430\u043a \u043d\u0430\u0443\u0447\u043d\u043e-\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0430 \u0441\u0442\u0430\u043b\u0430 \u0432\u0435\u0434\u0443\u0449\u0438\u043c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u043e\u043c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0432\u044b\u0441\u0448\u0435\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u043c \u043c\u0438\u0440\u0435.\n                \n                ",null,null,null,null,null)
B.L3=new A.b8("                \u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f \u041a\u0430\u043d\u0442\u0430 \u0433\u043e\u0432\u043e\u0440\u0438\u0442 \u043e\u0431 \u043e\u0431\u044b\u0447\u043d\u043e\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435, \u043d\u043e \u0441 \u0442\u043e\u0447\u043a\u0438 \u0437\u0440\u0435\u043d\u0438\u044f \u0433\u043b\u0443\u0431\u043e\u043a\u043e\u0433\u043e \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u0440\u043e\u0441\u043e\u0437\u0435\u0440\u0446\u0430\u043d\u0438\u044f. \u042d\u0442\u043e \u043c\u0438\u0440\u043e\u0441\u043e\u0437\u0435\u0440\u0446\u0430\u043d\u0438\u0435 \u041a\u0430\u043d\u0442 \u0432\u044b\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u043b \u0432 \u0441\u0432\u043e\u0438\u0445 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0445 \u0440\u0430\u0431\u043e\u0442\u0430\u0445, \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u044b\u0445 \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0438 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438, \u0432 \xab\u041a\u0440\u0438\u0442\u0438\u043a\u0435 \u0447\u0438\u0441\u0442\u043e\u0433\u043e \u0440\u0430\u0437\u0443\u043c\u0430\xbb, \u0432 \xab\u041a\u0440\u0438\u0442\u0438\u043a\u0435 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0443\u043c\u0430\xbb, \xab\u041a\u0440\u0438\u0442\u0438\u043a\u0435 \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u0438 \u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044f\xbb \u0438 \u0434\u0440\u0443\u0433\u0438\u0445. \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f\xbb \u2014 \u0440\u0430\u0431\u043e\u0442\u0430 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u0430\u044f. \u0412 \u043d\u0435\u0439 \u0430\u0431\u0441\u0442\u0440\u0430\u043a\u0442\u043d\u044b\u0435 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u0438\u0435 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u041a\u0430\u043d\u0442 \u0432\u044b\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u043b \u0432\u0441\u044e \u0441\u0432\u043e\u044e \u0436\u0438\u0437\u043d\u044c, \u043f\u0440\u0438\u043c\u0435\u043d\u044f\u044e\u0442\u0441\u044f \u043a \u0441\u0430\u043c\u043e\u0439 \u044d\u0442\u043e\u0439 \u0436\u0438\u0437\u043d\u0438, \u043a \u043e\u0434\u043d\u043e\u043c\u0443 \u0438\u0437 \u0432\u0438\u0434\u043e\u0432 \u0440\u0430\u0437\u0443\u043c\u043d\u044b\u0445 \u0441\u0443\u0449\u0435\u0441\u0442\u0432, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u043b\u044e\u0434\u044c\u043c\u0438. \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f\xbb \u043e\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442 \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0436\u0438\u0437\u043d\u044c \u043b\u044e\u0434\u0435\u0439, \u043d\u0430\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u044f \u043d\u0430\u0434 \u044d\u0442\u043e\u0439 \u0436\u0438\u0437\u043d\u044c\u044e. \u041d\u043e \u0435\u0441\u043b\u0438 \u0431\u044b \u044d\u0442\u043e \u0431\u044b\u043b\u0438 \u043f\u0440\u043e\u0441\u0442\u043e \u043d\u0430\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u044f, \u0442\u043e \u043c\u044b \u0438\u043c\u0435\u043b\u0438 \u0431\u044b \u043a\u0430\u043a\u043e\u0439-\u043d\u0438\u0431\u0443\u0434\u044c \u0436\u0430\u043d\u0440 \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0438\u043b\u0438 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b. \u041e\u0441\u0432\u0435\u0449\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u0438\u043c \u043c\u0438\u0440\u043e\u0441\u043e\u0437\u0435\u0440\u0446\u0430\u043d\u0438\u0435\u043c \u043f\u0440\u0438\u0434\u0430\u0435\u0442 \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u0435 \u043d\u0435 \u0441\u0432\u043e\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0431\u044b\u0447\u043d\u044b\u043c \u0442\u0435\u043a\u0441\u0442\u0430\u043c, \u0442\u0440\u0430\u043a\u0442\u0443\u044e\u0449\u0438\u043c \u0436\u0438\u0437\u043d\u044c \u0438 \u043f\u043e\u0441\u0442\u0443\u043f\u043a\u0438 \u043b\u044e\u0434\u0435\u0439, \u0438 \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u043f\u0440\u0438\u0434\u0430\u0435\u0442 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0430\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0430\u043b\u0438\u0437\u043c. \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f\xbb \u0441\u043e\u0433\u043b\u0430\u0441\u0443\u0435\u0442 \u043d\u0430\u0448\u0443 \u043e\u0431\u044b\u0447\u043d\u0443\u044e \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0443\u044e (\xab\u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e\xbb) \u0436\u0438\u0437\u043d\u044c \u0441 \u0433\u043b\u0443\u0431\u043e\u043a\u0438\u043c \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u0435\u043c \u043c\u0435\u0441\u0442\u0430 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0432 \u043c\u0438\u0440\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u0438 \u0433\u043b\u0430\u0432\u043d\u044b\u0445 \u0440\u0435\u0433\u0443\u043b\u044f\u0442\u043e\u0440\u043e\u0432 \u043f\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u041e\u043d\u0430 \u043a\u0430\u043a \u0431\u044b \u0433\u043e\u0432\u043e\u0440\u0438\u0442 \u043d\u0430\u043c, \u0447\u0442\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0441\u043e \u0432\u0441\u0435\u043c\u0438 \u0435\u0433\u043e \u0441\u043b\u0430\u0431\u043e\u0441\u0442\u044f\u043c\u0438 \u0438 \u043f\u0440\u0435\u0434\u0440\u0430\u0441\u0441\u0443\u0434\u043a\u0430\u043c\u0438 \u0432\u0441\u0435 \u0436\u0435 \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u0440\u0430\u0437\u0443\u043c\u043d\u044b\u043c \u0438 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u043c, \u0434\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442, \u0447\u0442\u043e \u043e\u043d \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0434\u043e\u043b\u0436\u0435\u043d \u0431\u044b\u0442\u044c \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c, \u043d\u043e \u043c\u043e\u0436\u0435\u0442 \u0438\u043c \u0431\u044b\u0442\u044c, \u0430 \u0438\u043d\u043e\u0433\u0434\u0430 \u0438\u043c \u0438 \u0431\u044b\u0432\u0430\u0435\u0442. \u041f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u0418\u043e\u0430\u0445\u0438\u043c\u0430 \u041a\u043e\u043f\u043f\u0435\u0440\u0430, \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f\xbb \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0447\u0442\u043e-\u0442\u043e \u0432\u0440\u043e\u0434\u0435 \u043c\u043e\u0441\u0442\u0430 \u043c\u0435\u0436\u0434\u0443 \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0438 \u0443\u0441\u043b\u043e\u0432\u043d\u043e\u0439 \u0436\u0438\u0437\u043d\u044c\u044e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u0431\u0435\u0437\u0443\u0441\u043b\u043e\u0432\u043d\u044b\u043c \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u0438\u043c \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u0435\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u043a\u0430\u043a \xab\u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0435\u0439 \u0441\u0432\u043e\u0435\u0439 \u0446\u0435\u043b\u0438\xbb, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0434\u0430\u0435\u0442 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u0443\u044e \u043f\u0435\u0440\u0441\u043f\u0435\u043a\u0442\u0438\u0432\u0443 \u0440\u0430\u0441\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u0438\u044f \u0444\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0436\u0438\u0437\u043d\u0438. \u041e\u0434\u043d\u0430\u043a\u043e \u0434\u043b\u044f \u043d\u0430\u0441 \u0432\u0430\u0436\u043d\u043e \u0438 \u0434\u0440\u0443\u0433\u043e\u0435. \u041f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u043e\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440 \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u0438\xbb \u043f\u043e\u0437\u0432\u043e\u043b\u044f\u0435\u0442 \u043f\u043e\u043d\u044f\u0442\u044c \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u041a\u0430\u043d\u0442\u0430 \u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0438, \u043d\u0430 \u043d\u0430\u0433\u043b\u044f\u0434\u043d\u044b\u0445 \u043f\u0440\u0438\u043c\u0435\u0440\u0430\u0445. \u042d\u0442\u043e \u043c\u043e\u0436\u0435\u0442 \u043f\u043e\u043c\u043e\u0447\u044c \u0447\u0438\u0442\u0430\u0442\u0435\u043b\u044e, \u043d\u0435\u0438\u0441\u043a\u0443\u0448\u0435\u043d\u043d\u043e\u043c\u0443 \u0432 \u0442\u043e\u043d\u043a\u043e\u0441\u0442\u044f\u0445 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u0438\u0445 \u0440\u0430\u0437\u043c\u044b\u0448\u043b\u0435\u043d\u0438\u0439 \u0438 \u043d\u0435 \u0438\u043c\u0435\u044e\u0449\u0435\u043c\u0443 \u0432\u043a\u0443\u0441\u0430 \u043a \u0430\u0431\u0441\u0442\u0440\u0430\u043a\u0442\u043d\u044b\u043c \u0440\u0430\u0441\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044f\u043c, \u043f\u0440\u043e\u043d\u0438\u043a\u043d\u0443\u0442\u044c \u0432 \u0441\u0435\u0440\u0434\u0446\u0435\u0432\u0438\u043d\u0443 \u043a\u0430\u043d\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438, \u043f\u043e\u043d\u044f\u0442\u044c \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u043d\u0443\u044e \u0438\u043c \u0441\u0438\u0441\u0442\u0435\u043c\u0443 \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u0435\u0439 \u0434\u0443\u0448\u0438 (\u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u044c, \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u044c \u0436\u0435\u043b\u0430\u043d\u0438\u044f, \u0447\u0443\u0432\u0441\u0442\u0432\u043e \u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u044f \u0438\u043b\u0438 \u043d\u0435\u0443\u0434\u043e\u0432\u043e\u043b\u044c\u0441\u0442\u0432\u0438\u044f), \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u043a\u043d\u0438\u0433\u0438 \u2014 \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0434\u0438\u0434\u0430\u043a\u0442\u0438\u043a\u0430\xbb, \u0443\u0437\u043d\u0430\u0442\u044c \u0435\u0433\u043e \u0432\u0437\u0433\u043b\u044f\u0434\u044b \u043f\u043e \u043a\u043b\u044e\u0447\u0435\u0432\u044b\u043c \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430\u043c \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u2014 \u043e \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0438 \u0435\u0435 \u0442\u0438\u043f\u0430\u0445, \u043e \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0430\u0445 \u0438 \u043e\u0431 \u043e\u0431\u0440\u0430\u0437\u0435 \u043c\u044b\u0441\u043b\u0435\u0439, \u043e \u043d\u0430\u0440\u043e\u0434\u0435 \u0438 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438, \u0438 \u0440\u0430\u0441\u0430\u0445 \u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0435 \u0432 \u0446\u0435\u043b\u043e\u043c. \u041a\u0430\u043d\u0442 \u043e\u0447\u0435\u043d\u044c \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u043e \u0441\u0443\u0434\u0438\u043b \u043e \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0445 \u043d\u0430\u0440\u043e\u0434\u0430\u0445, \u0432 \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u0438\xbb \u0438\u043c\u0435\u044e\u0442\u0441\u044f \u0442\u043e\u0447\u043d\u044b\u0435 \u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044f \u043e\u0431 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0430\u0445, \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0430\u0445, \u043d\u0435\u043c\u0446\u0430\u0445, \u043d\u043e \u0441\u0442\u0430\u0440\u0430\u043b\u0441\u044f \u043d\u0435 \u0441\u0443\u0434\u0438\u0442\u044c \u0442\u0430\u043c, \u0433\u0434\u0435 \u043d\u0435 \u043e\u0431\u043b\u0430\u0434\u0430\u043b \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u044b\u043c \u0437\u0430\u043f\u0430\u0441\u043e\u043c \u0437\u043d\u0430\u043d\u0438\u0439, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u043e \u0440\u0443\u0441\u0441\u043a\u0438\u0445. \u0422\u0430\u043c \u0436\u0435 \u043c\u043e\u0436\u043d\u043e \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u0442\u044c\u0441\u044f \u0441 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u044b\u043c\u0438 \u0438 \u043d\u0435\u043e\u0436\u0438\u0434\u0430\u043d\u043d\u044b\u043c\u0438 \u0432\u044b\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u043d\u0438\u044f\u043c\u0438 \u041a\u0430\u043d\u0442\u0430 \u043e \u043c\u0443\u0436\u0447\u0438\u043d\u0430\u0445 \u0438 \u0436\u0435\u043d\u0449\u0438\u043d\u0430\u0445, \u043e \u043c\u043e\u0434\u0435, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f \u043a \xab\u0440\u0443\u0431\u0440\u0438\u043a\u0435 \u0442\u0449\u0435\u0441\u043b\u0430\u0432\u0438\u044f\xbb.\n                \u0412 \u044d\u0442\u043e\u043c \u043e\u0447\u0435\u0440\u043a\u0435 \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u044b \u043b\u0438\u0448\u044c \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u044b\u0435 \u043f\u043e\u043d\u044f\u0442\u0438\u044f \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u041a\u0430\u043d\u0442\u0430, \u0447\u0442\u043e\u0431\u044b \u0438\u043c\u0435\u0442\u044c \u043e \u043d\u0435\u0439 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0432\u043f\u0435\u0447\u0430\u0442\u043b\u0435\u043d\u0438\u0435 \u043b\u0443\u0447\u0448\u0435 \u0432\u0441\u0435\u0433\u043e \u0447\u0438\u0442\u0430\u0442\u044c \u0440\u0430\u0431\u043e\u0442\u044b \u0441\u0430\u043c\u043e\u0433\u043e \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0430.\n                ",null,null,null,null,null)
B.L4=new A.b8("                \u0422\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043d\u0430\u044f \u043d\u0430 \u043f\u043e\u043d\u044f\u0442\u0438\u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0438 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f \u0430\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f \u043a \u0442\u043e\u0439 \u0436\u0435 \u0441\u0430\u043c\u043e\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u044d\u043f\u043e\u0445\u0435, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0436\u0438\u0432\u0435\u043c \u0438 \u043c\u044b \u0441 \u0432\u0430\u043c\u0438. \u0412 \u044d\u0442\u043e\u043c \u0441\u043c\u044b\u0441\u043b\u0435 \u043a\u0430\u043d\u0442\u043e\u0432\u0441\u043a\u0430\u044f \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f\xbb \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430 \u043d\u0430\u043c. \n                ",null,B.al,null,null,null)
