B.L6=new A.b8("             \u0424\u0438\u043b\u043e\u0441\u043e\u0301\u0444\u0438\u044f (\u0434\u0440.-\u0433\u0440\u0435\u0447. \u03c6\u03b9\u03bb\u03bf\u03c3\u03bf\u03c6\u03af\u03b1, \u0434\u043e\u0441\u043b\u043e\u0432\u043d\u043e\u2009\u2014 \xab\u043b\u044e\u0431\u043e\u043c\u0443\u0434\u0440\u0438\u0435; \u043b\u044e\u0431\u043e\u0432\u044c \u043a \u043c\u0443\u0434\u0440\u043e\u0441\u0442\u0438\xbb) \u2014 \u043e\u0441\u043e\u0431\u0430\u044f \u0444\u043e\u0440\u043c\u0430 \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f \u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0437\u043d\u0430\u043d\u0438\u0439 \u043e\u0431 \u043e\u0431\u0449\u0438\u0445 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043a\u0430\u0445, \u043f\u043e\u043d\u044f\u0442\u0438\u044f\u0445 \u0438 \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0430\u0445 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 (\u0431\u044b\u0442\u0438\u044f), \u0430 \u0442\u0430\u043a\u0436\u0435 \u0431\u044b\u0442\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u043e\u0431 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438 \u043e\u043a\u0440\u0443\u0436\u0430\u044e\u0449\u0435\u0433\u043e \u0435\u0433\u043e \u043c\u0438\u0440\u0430.\n                \u041a \u0437\u0430\u0434\u0430\u0447\u0430\u043c \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u043d\u0430 \u043f\u0440\u043e\u0442\u044f\u0436\u0435\u043d\u0438\u0438 \u0432\u0435\u043a\u043e\u0432 \u043e\u0442\u043d\u043e\u0441\u0438\u043b\u0438\u0441\u044c \u043a\u0430\u043a \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u0435 \u0432\u0441\u0435\u043e\u0431\u0449\u0438\u0445 \u0437\u0430\u043a\u043e\u043d\u043e\u0432 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043c\u0438\u0440\u0430 \u0438 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430, \u0442\u0430\u043a \u0438 \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u0435 \u0441\u0430\u043c\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430 \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f \u0438 \u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u0435 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0439 \u0438 \u0446\u0435\u043d\u043d\u043e\u0441\u0442\u0435\u0439. \u041a \u0447\u0438\u0441\u043b\u0443 \u043f\u0440\u0435\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0441\u043a\u0438\u0445 \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u0432 \u043e\u0442\u043d\u043e\u0441\u044f\u0442\u0441\u044f, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0432\u043e\u043f\u0440\u043e\u0441\u044b: \xab\u041f\u043e\u0437\u043d\u0430\u0432\u0430\u0435\u043c \u043b\u0438 \u043c\u0438\u0440?\xbb, \xab\u0421\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u043b\u0438 \u0411\u043e\u0433?\xbb, \xab\u0427\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0438\u0441\u0442\u0438\u043d\u0430?\xbb, \xab\u0427\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0445\u043e\u0440\u043e\u0448\u043e?\xbb, \xab\u0427\u0442\u043e \u0435\u0441\u0442\u044c \u0427\u0435\u043b\u043e\u0432\u0435\u043a?\xbb, \xab\u0427\u0442\u043e \u043f\u0435\u0440\u0432\u0438\u0447\u043d\u043e \u2014 \u043c\u0430\u0442\u0435\u0440\u0438\u044f \u0438\u043b\u0438 \u0441\u043e\u0437\u043d\u0430\u043d\u0438\u0435?\xbb, \xab\u0412 \u0447\u0451\u043c \u0441\u043c\u044b\u0441\u043b \u0436\u0438\u0437\u043d\u0438?\xbb \u0438 \u0434\u0440\u0443\u0433\u0438\u0435.\n                \u0424\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u044f \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u0432 \u0432\u0438\u0434\u0435 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0445 \u043e\u0431\u043b\u0430\u0441\u0442\u0435\u0439 \u0438 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043c\u043e\u0433\u0443\u0442 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0441\u0442\u043e\u044f\u0442\u044c \u0438 \u0434\u043e\u043f\u043e\u043b\u043d\u044f\u0442\u044c \u0434\u0440\u0443\u0433 \u0434\u0440\u0443\u0433\u0430. \u0421\u0435\u0439\u0447\u0430\u0441 \u043a \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u043e\u0442\u043d\u043e\u0441\u044f\u0442: \u043c\u0435\u0442\u0430\u0444\u0438\u0437\u0438\u043a\u0443, \u044d\u043f\u0438\u0441\u0442\u0435\u043c\u043e\u043b\u043e\u0433\u0438\u044e, \u043b\u043e\u0433\u0438\u043a\u0443, \u044d\u0442\u0438\u043a\u0443, \u044d\u0441\u0442\u0435\u0442\u0438\u043a\u0443, \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u0443\u044e \u0438 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u044e \u0438 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u044e \u043d\u0430\u0443\u043a\u0438.\n                \u0422\u0435 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f, \u0434\u043b\u044f \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0443\u0434\u0430\u0451\u0442\u0441\u044f \u0432\u044b\u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u044f\u0441\u043d\u0443\u044e \u0438 \u0440\u0430\u0431\u043e\u0442\u043e\u0441\u043f\u043e\u0441\u043e\u0431\u043d\u0443\u044e \u043c\u0435\u0442\u043e\u0434\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u043f\u0430\u0440\u0430\u0434\u0438\u0433\u043c\u0443, \u0432\u044b\u0434\u0435\u043b\u044f\u044e\u0442\u0441\u044f \u0438\u0437 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u0432 \u043d\u0430\u0443\u0447\u043d\u044b\u0435 \u0434\u0438\u0441\u0446\u0438\u043f\u043b\u0438\u043d\u044b, \u043a\u0430\u043a, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0438\u0437 \u0434\u0440\u0435\u0432\u043d\u0435\u0439 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u0432\u044b\u0434\u0435\u043b\u0438\u043b\u0438\u0441\u044c \u0444\u0438\u0437\u0438\u043a\u0430, \u0431\u0438\u043e\u043b\u043e\u0433\u0438\u044f \u0438 \u043f\u0441\u0438\u0445\u043e\u043b\u043e\u0433\u0438\u044f.\n                ",null,null,null,null,null)
B.L7=new A.b8("                \u041e \u0447\u0435\u043c \u044f \u043c\u043e\u0433\u0443 \u0432\u044b\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0442\u044c \u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043c\u043e\u0433\u0443\u0442 \u0431\u044b\u0442\u044c \u043e\u0431\u043e\u0441\u043d\u043e\u0432\u0430\u043d\u044b \u0432\u0441\u0435\u043e\u0431\u0449\u0438\u043c \u0438 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u0430 \u043e \u0447\u0435\u043c \u043d\u0435 \u043c\u043e\u0433\u0443? \n                ",null,B.al,null,null,null)
B.L8=new A.b8("                \u041f\u043e \u041a\u0430\u043d\u0442\u0443, \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u044f \u0434\u043b\u044f \u0442\u0430\u043a\u043e\u0439 \u043d\u0430\u0434\u0435\u0436\u0434\u044b \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u043e\u0436\u0438\u0442\u044c \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 \u0411\u043e\u0433\u0430. \u0422\u043e\u043b\u044c\u043a\u043e \u0411\u043e\u0433 \u043c\u043e\u0436\u0435\u0442 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0442\u044c \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u0443\u044e \u0441\u0432\u044f\u0437\u044c \u043c\u0435\u0436\u0434\u0443 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e \u0438 \u0441\u0447\u0430\u0441\u0442\u044c\u0435\u043c, \u0435\u0441\u043b\u0438 \u043d\u0435 \u0432 \u044d\u0442\u043e\u043c, \u0442\u0430\u043a \u0432 \u0434\u0440\u0443\u0433\u043e\u043c \u043c\u0438\u0440\u0435. \u041d\u043e \u044d\u0442\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u0435\u0442, \u0447\u0442\u043e \u043c\u044b \u0442\u0430\u043a\u0436\u0435 \u0434\u043e\u043b\u0436\u043d\u044b \u043f\u0440\u0438\u0437\u043d\u0430\u0442\u044c \u0431\u0435\u0441\u0441\u043c\u0435\u0440\u0442\u0438\u0435 \u0434\u0443\u0448\u0438, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443, \u0435\u0441\u043b\u0438 \u0434\u0443\u0448\u0430 \u0443\u043c\u0438\u0440\u0430\u0435\u0442 \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0442\u0435\u043b\u043e\u043c, \u0442\u043e \u0432\u0435\u0441\u044c \u043d\u0430\u0448 \u043e\u043f\u044b\u0442 \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443\u0435\u0442, \u0447\u0442\u043e \u0434\u043b\u044f \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u0430 \u043b\u044e\u0434\u0435\u0439 \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u0437\u0435\u043c\u043d\u043e\u0439 \u0436\u0438\u0437\u043d\u0438 \u043d\u0438\u043a\u0430\u043a\u043e\u0433\u043e \u0441\u0447\u0430\u0441\u0442\u044c\u044f \u0438\u0437 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u0430 \u043c\u044b\u0441\u043b\u0435\u0439 \u043d\u0435 \u0441\u043b\u0435\u0434\u0443\u0435\u0442. \u041d\u043e, \u043f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u0411\u043e\u0433 \u043c\u043e\u0436\u0435\u0442 \u0434\u0430\u0442\u044c \u0441\u0447\u0430\u0441\u0442\u044c\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0442\u0435\u043c, \u043a\u0442\u043e \u0435\u0433\u043e \u0434\u043e\u0441\u0442\u043e\u0438\u043d, \u0442\u043e \u0434\u043e\u043b\u0436\u043d\u0430 \u0431\u044b\u0442\u044c \u0438 \u0441\u0432\u043e\u0431\u043e\u0434\u0430 \u043a\u0430\u043a \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0438 \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438 \u0431\u044b\u0442\u044c \u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432\u044b\u043c. \u0418\u0431\u043e \u0435\u0441\u043b\u0438 \u0431\u044b \u043d\u0435 \u0431\u044b\u043b\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u044b, \u0442\u043e \u043a\u0430\u043a\u043e\u0435 \u0436\u0435 \u044d\u0442\u043e \u0431\u044b\u043b\u043e \u0431\u044b \u0434\u043e\u0441\u0442\u043e\u0438\u043d\u0441\u0442\u0432\u043e? \u042d\u0442\u043e \u0431\u044b\u043b \u0431\u044b \u043f\u0440\u043e\u0441\u0442\u043e \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0439 \u0444\u0430\u043a\u0442 \u043f\u0440\u0438\u0440\u043e\u0434\u044b.\n                \u0418\u0442\u0430\u043a, \u0442\u0430\u043a\u0438\u0435 \u0438\u0434\u0435\u0438, \u043a\u0430\u043a \u0431\u0435\u0441\u0441\u043c\u0435\u0440\u0442\u0438\u0435 \u0434\u0443\u0448\u0438, \u0441\u0432\u043e\u0431\u043e\u0434\u0430, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 \u0411\u043e\u0433\u0430, \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u043a\u043e\u0442\u043e\u0440\u044b\u0445, \u043a\u0430\u043a \u043c\u044b \u0443\u0436\u0435 \u0443\u0431\u0435\u0434\u0438\u043b\u0438\u0441\u044c, \u043d\u0435\u0434\u043e\u043a\u0430\u0437\u0443\u0435\u043c\u0430 \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0438, \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 \u043e\u0431\u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435 \u0441\u0432\u043e\u0435\u0439 \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u043a\u0430\u043a \u043d\u0435\u0438\u0437\u0431\u0435\u0436\u043d\u044b\u0435 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0437\u0430\u043a\u043e\u043d\u0430 \u0438 \u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u0439 \u0440\u0430\u0437\u0443\u043c\u043d\u043e\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u043a \u0441\u0447\u0430\u0441\u0442\u044c\u044e \u041a\u0430\u043d\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0442\u0430\u043a\u0438\u0435 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043d\u0438\u044f \u043e \u0440\u0435\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u044d\u0442\u0438\u0445 \u0438\u0434\u0435\u0439 \u043f\u043e\u0441\u0442\u0443\u043b\u0430\u0442\u0430\u043c\u0438 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0443\u043c\u0430, \u043f\u043e\u0434\u0447\u0435\u0440\u043a\u0438\u0432\u0430\u044f, \u0447\u0442\u043e \u044d\u0442\u043e \u043d\u0435 \u0434\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0438\u0445 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0438, \u043d\u043e \u0437\u0430\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u043d\u0430\u0441 \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u043e\u0436\u0438\u0442\u044c \u0438\u0445 \u043a\u0430\u043a \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u0435 \u0443\u0441\u043b\u043e\u0432\u0438\u044f \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0436\u0438\u0437\u043d\u0438 \u0440\u0430\u0437\u0443\u043c\u043d\u043e\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u0432 \u043d\u0430\u0448\u0435\u043c \u043c\u0438\u0440\u0435.\n                \u041f\u043e\u0441\u0442\u0443\u043b\u0430\u0442 \u0431\u0435\u0441\u0441\u043c\u0435\u0440\u0442\u0438\u044f \u0434\u0443\u0448\u0438 \u0432\u044b\u0442\u0435\u043a\u0430\u0435\u0442 \u0438\u0437 \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0433\u043e \u0443\u0441\u043b\u043e\u0432\u0438\u044f \u0441\u043e\u0440\u0430\u0437\u043c\u0435\u0440\u043d\u043e\u0441\u0442\u0438 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f \u0441 \u043f\u043e\u043b\u043d\u043e\u0442\u043e\u0439 \u0432 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u0438 \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0437\u0430\u043a\u043e\u043d\u0430; \u043f\u043e\u0441\u0442\u0443\u043b\u0430\u0442 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u2014 \u0438\u0437 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u0438 \u0434\u043e\u043f\u0443\u0449\u0435\u043d\u0438\u044f \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u0440\u0430\u0437\u0443\u043c\u043d\u043e\u0433\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u043e\u0442 \u0447\u0443\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043c\u0438\u0440\u0430, \u0433\u0434\u0435 \u0432\u0441\u0435 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043e \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u043f\u0440\u0438\u0447\u0438\u043d\u0430\u043c\u0438, \u0438 \u0438\u0437 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0441\u0432\u043e\u0435\u0439 \u0432\u043e\u043b\u0438 \u043f\u043e \u0437\u0430\u043a\u043e\u043d\u0430\u043c \u043c\u0438\u0440\u0430 \u0438\u0434\u0435\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u041a\u0430\u043d\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u0443\u043c\u043e\u043f\u043e\u0441\u0442\u0438\u0433\u0430\u0435\u043c\u044b\u043c \u043c\u0438\u0440\u043e\u043c. \u0411\u044b\u0442\u0438\u0435 \u0411\u043e\u0433\u0430 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u044b\u043c \u0443\u0441\u043b\u043e\u0432\u0438\u0435\u043c \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f \u0432\u044b\u0441\u0448\u0435\u0433\u043e \u0431\u043b\u0430\u0433\u0430: \xab\u0442\u043e\u043b\u044c\u043a\u043e \u0435\u0441\u043b\u0438 \u043a \u043d\u0435\u0439 (\u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438) \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0435\u0442\u0441\u044f \u0440\u0435\u043b\u0438\u0433\u0438\u044f, \u043f\u043e\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0430\u0434\u0435\u0436\u0434\u0430 \u043a\u043e\u0433\u0434\u0430-\u043d\u0438\u0431\u0443\u0434\u044c \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u044c \u0441\u0447\u0430\u0441\u0442\u044c\u044f \u0432 \u0442\u043e\u0439 \u043c\u0435\u0440\u0435, \u0432 \u043a\u0430\u043a\u043e\u0439 \u043c\u044b \u0437\u0430\u0431\u043e\u0442\u0438\u043b\u0438\u0441\u044c \u043e \u0442\u043e\u043c, \u0447\u0442\u043e\u0431\u044b \u043d\u0435 \u0431\u044b\u0442\u044c \u043d\u0435\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u044b\u043c\u0438 \u0435\u0433\u043e\xbb.\n                \u041e\u0442\u0441\u044e\u0434\u0430 \u0432\u044b\u0442\u0435\u043a\u0430\u0435\u0442 \u043e\u0442\u0432\u0435\u0442 \u043d\u0430 \u0442\u0440\u0435\u0442\u0438\u0439 \u0432\u043e\u043f\u0440\u043e\u0441 \u041a\u0430\u043d\u0442\u0430: \u043c\u044b \u0441\u043c\u0435\u0435\u043c \u043d\u0430\u0434\u0435\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0447\u0430\u0441\u0442\u044c\u0435, \u0435\u0441\u043b\u0438 \u043c\u044b \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u044b \u0435\u0433\u043e \u0438 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u0432\u044b\u0441\u0448\u0430\u044f \u0438\u043d\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u2014 \u0411\u043e\u0433 \u2014 \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043c\u043e\u0436\u0435\u0442 \u0433\u0430\u0440\u0430\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043d\u0430\u043c \u0442\u043e, \u0447\u0442\u043e \u0438\u0437 \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u0438 \u0431\u044b\u0442\u044c \u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432\u044b\u043c \u0440\u0430\u043d\u043e \u0438\u043b\u0438 \u043f\u043e\u0437\u0434\u043d\u043e \u0432\u043e\u0441\u043f\u043e\u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u0441\u0447\u0430\u0441\u0442\u044c\u0435.\n                \u0420\u0435\u043b\u0438\u0433\u0438\u044f \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0437\u0443\u0435\u0442 \u043d\u0430\u0448\u0443 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044e\u044e \u0436\u0438\u0437\u043d\u044c \u0438 \u043d\u0430\u0448\u0438 \u043d\u0430\u0434\u0435\u0436\u0434\u044b \u043d\u0430 \u0436\u0438\u0437\u043d\u044c \u043d\u0430\u0448\u0435\u0433\u043e \u0434\u0443\u0445\u0430. \u041e\u0434\u043d\u0430\u043a\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\u0442 \u043b\u0438 \u043a\u0430\u043a\u0438\u0435-\u043b\u0438\u0431\u043e \u043d\u0430\u0434\u0435\u0436\u0434\u044b \u043d\u0430 \u0432\u043d\u0435\u0448\u043d\u044e\u044e \u0436\u0438\u0437\u043d\u044c, \u0430 \u0437\u043d\u0430\u0447\u0438\u0442 \u043d\u0430 \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441\u0438\u0432\u043d\u044b\u0439 \u0445\u043e\u0434 \u0438\u0441\u0442\u043e\u0440\u0438\u0438? \u0422\u0430\u043a \u0432 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u041a\u0430\u043d\u0442\u0430 \u0432\u043e\u0437\u043d\u0438\u043a\u0430\u0435\u0442 \u0442\u0435\u043c\u0430 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u0438. \u041a\u0430\u043d\u0442 \u0434\u043e\u0441\u0442\u0430\u0442\u043e\u0447\u043d\u043e \u0447\u0435\u0442\u043a\u043e \u0432\u0438\u0434\u0438\u0442 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0438 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441\u0430 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0430, \u0437\u0434\u0435\u0441\u044c \u0441\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u0432\u043b\u0438\u044f\u043d\u0438\u0435 \u0420\u0443\u0441\u0441\u043e, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432 \u0441\u0432\u043e\u0435\u043c \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u043c \xab\u0420\u0430\u0441\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u0438 \u043e \u043d\u0430\u0443\u043a\u0430\u0445 \u0438 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430\u0445\xbb \u0434\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u043b, \u0447\u0442\u043e \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b \u043d\u0435\u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c \u0441 \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441\u043e\u043c \u0432 \u043d\u0440\u0430\u0432\u0430\u0445. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0433\u043b\u0430\u0432\u043d\u044b\u0435 \u043d\u0430\u0434\u0435\u0436\u0434\u044b \u043d\u0430 \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u041a\u0430\u043d\u0442 \u0432\u043e\u0437\u043b\u0430\u0433\u0430\u0435\u0442 \u043d\u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044e \u0432\u043d\u0435\u0448\u043d\u0435\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u0410 \u044d\u0442\u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442 \u0434\u0432\u0430 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430: \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u0438 \u043f\u0440\u0430\u0432\u043e. \u041f\u0440\u0430\u0432\u043e \u0435\u0441\u0442\u044c \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u0441\u043f\u043e\u0441\u043e\u0431 \u0441\u043e\u0433\u043b\u0430\u0441\u043e\u0432\u0430\u043d\u0438\u044f \u0432\u043d\u0435\u0448\u043d\u0435\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u043b\u044e\u0434\u0435\u0439, \u0430 \xab\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u2014 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u0430 \u043b\u044e\u0434\u0435\u0439, \u043f\u043e\u0434\u0447\u0438\u043d\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u0430\u0432\u043e\u0432\u044b\u043c \u0437\u0430\u043a\u043e\u043d\u0430\u043c\xbb. \u041a\u0430\u043d\u0442 \u0432 \xab\u041c\u0435\u0442\u0430\u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043d\u0430\u0447\u0430\u043b\u0430\u0445 \u0443\u0447\u0435\u043d\u0438\u044f \u043e \u043f\u0440\u0430\u0432\u0435\xbb \u0444\u043e\u0440\u043c\u0443\u043b\u0438\u0440\u0443\u0435\u0442 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0438\u0432 \u043f\u0440\u0430\u0432\u0430: \xab\u041f\u043e\u0441\u0442\u0443\u043f\u0430\u0439 \u0432\u043d\u0435\u0448\u043d\u0435 \u0442\u0430\u043a, \u0447\u0442\u043e\u0431\u044b \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0435 \u043f\u0440\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u0435 \u0442\u0432\u043e\u0435\u0433\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u043b\u0430 \u0431\u044b\u043b\u043e \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c\u043e \u0441\u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043e\u0439 \u043a\u0430\u0436\u0434\u043e\u0433\u043e, \u0441\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u043e \u0441\u043e \u0432\u0441\u0435\u043e\u0431\u0449\u0438\u043c \u0437\u0430\u043a\u043e\u043d\u043e\u043c\xbb.\n                \u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0432\u043d\u0435\u0448\u043d\u0435\u0439 \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0433\u0440\u0430\u0436\u0434\u0430\u043d \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442 \u0442\u043e, \u0447\u0442\u043e \u041a\u0430\u043d\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043f\u0440\u0430\u0432\u043e\u0432\u044b\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c. \u0412 \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u043b \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0445 \u043b\u0438\u0446, \u043d\u043e, \u0432 \u0442\u043e \u0436\u0435 \u0432\u0440\u0435\u043c\u044f, \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d \u0438 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u043b \u0441\u0430\u043c\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u043c\u044b \u043c\u043e\u0436\u0435\u043c, \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044f \u043c\u044b\u0441\u043b\u044c \u041a\u0430\u043d\u0442\u0430, \u0441\u043a\u0430\u0437\u0430\u0442\u044c, \u0447\u0442\u043e \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u2014 \u044d\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u043b \u0438 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043b\u0438\u0446\u0430, \u0438 \u0441\u0430\u043c\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d \u0437\u0430\u043a\u043e\u043d\u043e\u043c.\n                \u041f\u043e \u041a\u0430\u043d\u0442\u0443, \u0438\u0441\u0442\u043e\u0440\u0438\u044f \u0435\u0441\u0442\u044c \u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u043e\u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043a \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u043c\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0443. \u041e\u0434\u043d\u0430\u043a\u043e \u0432 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u044b \u0442\u0430\u043a\u0436\u0435 \u043d\u0430\u0445\u043e\u0434\u0438\u043c \u0432\u0437\u0430\u0438\u043c\u043e\u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043c\u0435\u0436\u0434\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430\u043c\u0438, \u0438 \u041a\u0430\u043d\u0442 \u0437\u0430\u043c\u0435\u0447\u0430\u0435\u0442, \u0447\u0442\u043e \u0435\u0441\u043b\u0438 \u0432\u043d\u0443\u0442\u0440\u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432 \u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u043e, \u0441 \u0431\u043e\u043b\u044c\u0448\u0438\u043c \u0438\u043b\u0438 \u043c\u0435\u043d\u044c\u0448\u0438\u043c \u0443\u0441\u043f\u0435\u0445\u043e\u043c, \u0441 \u043e\u0442\u043a\u043b\u043e\u043d\u0435\u043d\u0438\u044f\u043c\u0438, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u0435\u0442 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043a \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u043c\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0443, \u0442\u043e \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\u0445 \u043c\u0435\u0436\u0434\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u0432\u0443\u0435\u0442 \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e, \u0442.\u0435. \u043f\u0440\u0430\u0432\u043e \u0441\u0438\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u0433\u043e. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0435\u0449\u0435 \u043e\u0434\u043d\u0430 \u0438\u0445 \u0446\u0435\u043b\u0435\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u2014 \u044d\u0442\u043e \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0440\u0430\u0432\u043e\u0432\u044b\u0445 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439 \u043c\u0435\u0436\u0434\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430\u043c\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0434\u043e\u043b\u0436\u043d\u044b \u043f\u0440\u0438\u0432\u0435\u0441\u0442\u0438 \u043a \u043f\u043e\u0441\u0442\u0435\u043f\u0435\u043d\u043d\u043e\u043c\u0443 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044e \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432 \u0438 \u0432\u0435\u0447\u043d\u043e\u043c\u0443 \u043c\u0438\u0440\u0443. \u041e\u0434\u043d\u0430\u043a\u043e \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043a \u043f\u0440\u0430\u0432\u043e\u0432\u043e\u043c\u0443 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0443 \u0438 \u0432\u0435\u0447\u043d\u043e\u043c\u0443 \u043c\u0438\u0440\u0443 \u043d\u0435 \u0435\u0441\u0442\u044c \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439, \u0434\u0435\u0442\u0435\u0440\u043c\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u043f\u0440\u043e\u0446\u0435\u0441\u0441.\n                \u0412 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043f\u0440\u043e\u0433\u0440\u0435\u0441\u0441 \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0442\u0435\u043c, \u0447\u0442\u043e \u041a\u0430\u043d\u0442 \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \xab\u043d\u0435\u043e\u0431\u0449\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043e\u0431\u0449\u0435\u043d\u0438\u0435\u043c\xbb, \u0442.\u0435. \u0442\u0435\u043c \u0444\u0430\u043a\u0442\u043e\u043c, \u0447\u0442\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0441 \u0434\u0432\u0443\u043c\u044f \u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u044f\u043c\u0438: 1) \u043a \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u043c\u0443 \u044d\u0433\u043e\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044e \u0437\u0430 \u0441\u0447\u0435\u0442 \u0434\u0440\u0443\u0433\u0438\u0445 \u0438 2) \u043a \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044e. \u042d\u0442\u0438 \u0434\u0432\u0435 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u043b\u043e\u0436\u043d\u044b\u0445 \u0443\u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u044f \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0442 \u0434\u0432\u0438\u0436\u0443\u0449\u0443\u044e \u0441\u0438\u043b\u0443 \u0438\u0441\u0442\u043e\u0440\u0438\u0438, \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b, \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043f\u0440\u0430\u0432\u0430 \u0438 \u0442.\u043f.\n                \u0412 \u0445\u043e\u0434\u0435 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u0443\u0435\u0442 \u0441\u0430\u043c \u0441\u0435\u0431\u044f. \u0411\u0435\u0437 \u0441\u043e\u0437\u043d\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0443\u0441\u0438\u043b\u0438\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u043f\u043e \u0441\u0430\u043c\u043e\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044e \u0438\u0441\u0442\u043e\u0440\u0438\u044f \u043d\u0435 \u0441\u043c\u043e\u0436\u0435\u0442 \u0434\u0432\u0438\u0433\u0430\u0442\u044c\u0441\u044f \u0432 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u0431\u043b\u0430\u0433\u043e\u043f\u0440\u0438\u044f\u0442\u043d\u043e\u043c \u0434\u043b\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u043e\u0434\u0430. \u0412\u043e\u043e\u0431\u0449\u0435 \u0442\u0430\u043a\u0438\u0435 \u0443\u0441\u0438\u043b\u0438\u044f \u043d\u043e\u0441\u044f\u0442 \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440, \u043d\u043e \u043e\u043d\u0438 \u043c\u043e\u0433\u0443\u0442 \u0438 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u0438\u0437\u0438\u0440\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0432 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0445 \u044d\u043f\u043e\u0445\u0430\u0445 \u043a\u0430\u043a \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u0437\u0430\u0434\u0430\u0447\u0438. \u0422\u0430\u043a \u0432\u043e\u0437\u043d\u0438\u043a\u0430\u0435\u0442 \u043a\u0430\u043d\u0442\u043e\u0432\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0438\u044f \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f, \u043e\u0444\u043e\u0440\u043c\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u0432 \u0440\u0430\u043c\u043a\u0430\u0445 \u0440\u0430\u0437\u0440\u0430\u0437\u0438\u0432\u0448\u0435\u0439 \u0432 \u0443\u0447\u0435\u043d\u044b\u0445 \u043a\u0440\u0443\u0433\u0430\u0445 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u0434\u0438\u0441\u043a\u0443\u0441\u0441\u0438\u0438 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u044d\u0442\u043e\u0433\u043e \u043f\u043e\u043d\u044f\u0442\u0438\u044f.\n                ",null,null,null,null,null)
B.L9=new A.b8("                \u0412 \u0432\u044b\u0441\u0448\u0435\u043c \u0431\u043b\u0430\u0433\u0435 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c, \u0434\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u0441\u0442\u044c \u0431\u044b\u0442\u044c \u0441\u0447\u0430\u0441\u0442\u043b\u0438\u0432\u044b\u043c, \u043e\u0431\u043b\u0430\u0434\u0430\u0435\u0442 \u043f\u0435\u0440\u0432\u0435\u043d\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u043c \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435\u043c, \u043e\u043d\u043e \u043d\u0435 \u043c\u043e\u0436\u0435\u0442 \u0432\u044b\u0442\u0435\u043a\u0430\u0442\u044c \u0438\u0437 \u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u044f \u043a \u0441\u0447\u0430\u0441\u0442\u044c\u044e. \u041d\u043e \u0438 \u0438\u0437 \u043d\u0440\u0430\u0432\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u043d\u0435 \u0432\u044b\u0442\u0435\u043a\u0430\u0435\u0442 \u0441\u0447\u0430\u0441\u0442\u044c\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u0422\u0430\u043a \u043c\u043e\u0436\u0435\u0442 \u043b\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430\u0434\u0435\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0447\u0430\u0441\u0442\u044c\u0435? \u041f\u0440\u0438\u0447\u0435\u043c, \u043d\u0430 \u0442\u0430\u043a\u043e\u0435 \u0441\u0447\u0430\u0441\u0442\u044c\u0435, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0431\u044b\u043b\u043e \u0431\u044b \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u044e\u0449\u0435\u0439 \u0447\u0430\u0441\u0442\u044c\u044e \u0432\u044b\u0441\u0448\u0435\u0433\u043e \u0431\u043b\u0430\u0433\u0430? \n                ",null,B.al,null,null,null)
B.La=new A.b8("                \u0427\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u043e \u0437\u0430\u0442\u0440\u0430\u0442\u0438\u043b\u043e \u043a\u043e\u043b\u043e\u0441\u0441\u0430\u043b\u044c\u043d\u044b\u0435 \u0443\u0441\u0438\u043b\u0438\u044f \u0434\u043b\u044f \u0442\u043e\u0433\u043e, \u0447\u0442\u043e\u0431\u044b \u0432\u044b\u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u043e\u0431\u0449\u0435\u0435 \u043f\u043e\u043d\u044f\u0442\u0438\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u0421\u0442\u043e\u0438\u043a\u0438 \u0432 \u0430\u043d\u0442\u0438\u0447\u043d\u043e\u0441\u0442\u0438, \u0445\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0435 \u043d\u0430 \u0435\u0435 \u0437\u0430\u043a\u0430\u0442\u0435 \u0438 \u0432 \u0440\u0430\u043d\u043d\u0435\u043c \u0421\u0440\u0435\u0434\u043d\u0435\u0432\u0435\u043a\u043e\u0432\u044c\u0435, \u0411\u0443\u0434\u0434\u0430 \u0440\u0430\u0437\u0440\u0443\u0448\u0430\u043b\u0438 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u043e \u0440\u0430\u0437\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0430 \u043d\u0430 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u043f\u043e \u043f\u0440\u0438\u0440\u043e\u0434\u0435 \u0438\u043b\u0438 \u043f\u043e \u0411\u043e\u0436\u044c\u0435\u043c\u0443 \u043f\u0440\u043e\u043c\u044b\u0441\u043b\u0443 \u043d\u0435\u0441\u043e\u0438\u0437\u043c\u0435\u0440\u0438\u043c\u044b\u0435 \u0433\u0440\u0443\u043f\u043f\u044b: \u0433\u0440\u0435\u043a\u043e\u0432 \u0438 \u0432\u0430\u0440\u0432\u0430\u0440\u043e\u0432, \u0438\u0437\u0431\u0440\u0430\u043d\u043d\u043e\u0433\u043e \u043d\u0430\u0440\u043e\u0434\u0430 \u0438 \u043d\u0435\u0438\u0437\u0431\u0440\u0430\u043d\u043d\u044b\u0445 \u043d\u0430\u0440\u043e\u0434\u043e\u0432, \u043f\u0440\u0430\u0432\u043e\u0432\u0435\u0440\u043d\u044b\u0445 \u0438 \u043d\u0435\u043f\u0440\u0430\u0432\u043e\u0432\u0435\u0440\u043d\u044b\u0445, \u0446\u0438\u0432\u0438\u043b\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u0438 \u043d\u0435\u0446\u0438\u0432\u0438\u043b\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u044b\u0445 \u0438 \u0442. \u043f. \u042d\u0442\u043e\u043c\u0443 \u0441\u0442\u0440\u0435\u043c\u043b\u0435\u043d\u0438\u044e \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u044c \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u043e\u0434\u0430 \u0432\u0441\u0435\u0433\u0434\u0430 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0441\u0442\u043e\u044f\u043b\u0438 \u0430\u0440\u0438\u0441\u0442\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435, \u0438\u0435\u0440\u0430\u0440\u0445\u0438\u0447\u0435\u0441\u043a\u0438\u0435, \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435, \u0440\u0430\u0441\u043e\u0432\u044b\u0435, \u043a\u043b\u0430\u0441\u0441\u043e\u0432\u044b\u0435 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0442\u0435\u043e\u0440\u0438\u0438. \u0423 \u0432\u0441\u0435\u0445 \u0442\u0435\u043e\u0440\u0438\u0439 \u0432\u0442\u043e\u0440\u043e\u0433\u043e \u0440\u043e\u0434\u0430 \u0435\u0441\u0442\u044c \u043e\u0434\u043d\u0430 \u043e\u0431\u0449\u0430\u044f \u0447\u0435\u0440\u0442\u0430: \u043a\u0430\u043a\u0430\u044f-\u0442\u043e \u0447\u0430\u0441\u0442\u044c \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0430 \u043f\u043e \u0442\u0435\u043c \u0438\u043b\u0438 \u0438\u043d\u044b\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u044f\u043c \u043f\u0440\u0438\u0437\u043d\u0430\u0435\u0442\u0441\u044f \u0432 \u0442\u043e\u043c \u0438\u043b\u0438 \u0438\u043d\u043e\u043c \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0432\u044b\u0448\u0435, \u043b\u0443\u0447\u0448\u0435, \u0438\u0437\u0431\u0440\u0430\u043d\u043d\u0435\u0435 \u0434\u0440\u0443\u0433\u043e\u0439, \u041f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u0435\u0434\u0438\u043d\u043e\u0433\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u0430, \u0430, \u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e, \u0438 \u043e\u0431\u0449\u0435\u0435 \u043f\u043e\u043d\u044f\u0442\u0438\u0435 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0432\u044b\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u043e\u0441\u044c \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u0425I\u0425 \u0432\u0435\u043a\u0435, \u0434\u0430 \u0438 \u0442\u043e \u0441 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043e\u0442\u0442\u0435\u043d\u043a\u043e\u043c \u0435\u0432\u0440\u043e\u043f\u043e\u0446\u0435\u043d\u0442\u0440\u0438\u0437\u043c\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0442\u0430\u043a \u043f\u0435\u0447\u0430\u043b\u044c\u043d\u043e \u0441\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043d\u0430 \u0441\u0443\u0434\u044c\u0431\u0435 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u043b\u0438\u0431\u0435\u0440\u0430\u043b\u0438\u0437\u043c\u0430 \u0432 \u0425\u0425 \u0432\u0435\u043a\u0435.\n                \u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044f \u2014 \u043d\u0430\u0443\u043a\u0430 \u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0435. \u041c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c, \u0441\u0432\u044f\u0437\u044c \u0441 \u0438\u0437\u043c\u0435\u043d\u0447\u0438\u0432\u044b\u043c \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u0438\u043c \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u043c \u0434\u0435\u043b\u0430\u0435\u0442 \u043a\u0430\u043d\u0442\u043e\u0432\u0441\u043a\u0443\u044e \xab\u0410\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u044e\xbb \u043d\u0435 \u043f\u043e\u0434\u0445\u043e\u0434\u044f\u0449\u0435\u0439 \u043d\u0430\u0448\u0435\u043c\u0443 \u0432\u0440\u0435\u043c\u0435\u043d\u0438? \u0427\u0442\u043e\u0431\u044b \u0438\u0437\u0431\u0435\u0436\u0430\u0442\u044c \u0434\u043b\u0438\u043d\u043d\u044b\u0445 \u0440\u0430\u0441\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u0439 \u043f\u043e \u044d\u0442\u043e\u043c\u0443 \u043f\u043e\u0432\u043e\u0434\u0443, \u044f \u043f\u0440\u043e\u0441\u0442\u043e \u0441\u043e\u0448\u043b\u044e\u0441\u044c \u043d\u0430 \u0442\u043e, \u0447\u0442\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0432 \u0441\u0432\u043e\u0435\u043c \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0435, \u043a\u0430\u043a \u0441\u0432\u0438\u0434\u0435\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443\u0435\u0442 \u043d\u0430\u0448 \u043e\u0431\u044b\u0434\u0435\u043d\u043d\u044b\u0439 \u043e\u043f\u044b\u0442, \u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f \u043e\u0447\u0435\u043d\u044c \u043c\u0430\u043b\u043e. \u041c\u044b\u0441\u043b\u0438 \u0438 \u0441\u0442\u0440\u0430\u0441\u0442\u0438 \u043c\u0430\u043b\u043e \u043c\u0435\u043d\u044f\u044e\u0442\u0441\u044f \u043e\u0442 \u044d\u043f\u043e\u0445\u0438 \u043a \u044d\u043f\u043e\u0445\u0435 \u0438\u043b\u0438 \u043e\u0442 \u043d\u0430\u0440\u043e\u0434\u0430 \u043a \u043d\u0430\u0440\u043e\u0434\u0443. \u0410 \u0435\u0441\u043b\u0438 \u0438 \u043c\u0435\u043d\u044f\u044e\u0442\u0441\u044f, \u0442\u043e \u044d\u0442\u043e \u043f\u0440\u0438\u0434\u0430\u0435\u0442 \u0434\u0440\u0443\u0433\u043e\u0439 \u044d\u043f\u043e\u0445\u0435 \u0438 \u043d\u0430\u0440\u043e\u0434\u0443 \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0438\u043d\u0442\u0435\u0440\u0435\u0441. \u041d\u043e \u044d\u0442\u043e\u0442 \u0438\u043d\u0442\u0435\u0440\u0435\u0441 \u0432\u043e\u0437\u043c\u043e\u0436\u0435\u043d \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u0440\u0438 \u043e\u0431\u0449\u0435\u043c \u0431\u0430\u0437\u0438\u0441\u0435, \u043d\u0430\u043b\u0438\u0447\u0438\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043e\u043d \u0438 \u0434\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442. \u0414\u0430\u0436\u0435 \u043f\u0440\u0438 \u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442\u0430\u0445 \u043b\u044e\u0434\u0438 \u043c\u0435\u043d\u044f\u044e\u0442\u0441\u044f \u043e\u0447\u0435\u043d\u044c \u043c\u0430\u043b\u043e, \u0447\u0442\u043e \u043e\u0442\u043c\u0435\u0447\u0430\u043b, \u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u041c\u0438\u0445\u0430\u0438\u043b \u0411\u0443\u043b\u0433\u0430\u043a\u043e\u0432 \u0432 \xab\u041c\u0430\u0441\u0442\u0435\u0440\u0435 \u0438 \u041c\u0430\u0440\u0433\u0430\u0440\u0438\u0442\u0435\xbb. \u0412\u0441\u043f\u043e\u043c\u043d\u0438\u043c \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u043e\u0435 \u0432\u044b\u0441\u043a\u0430\u0437\u044b\u0432\u0430\u043d\u0438\u0435 \u0412\u043e\u043b\u0430\u043d\u0434\u0430, \u043a\u043e\u0433\u0434\u0430 \u043e\u043d \u0440\u0430\u0441\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u043b \u043c\u043e\u0441\u043a\u0432\u0438\u0447\u0435\u0439 \u0432 \u0412\u0430\u0440\u044c\u0435\u0442\u0435: \xab\u041d\u0443 \u0447\u0442\u043e \u0436\u0435 ... \u043e\u043d\u0438 \u2014 \u043b\u044e\u0434\u0438 \u043a\u0430\u043a \u043b\u044e\u0434\u0438. \u041b\u044e\u0431\u044f\u0442 \u0434\u0435\u043d\u044c\u0433\u0438, \u043d\u043e \u0432\u0435\u0434\u044c \u044d\u0442\u043e \u0432\u0441\u0435\u0433\u0434\u0430 \u0431\u044b\u043b\u043e. \u0427\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u0442\u0432\u043e \u043b\u044e\u0431\u0438\u0442 \u0434\u0435\u043d\u044c\u0433\u0438, \u0438\u0437 \u0447\u0435\u0433\u043e \u0431\u044b \u0442\u0435 \u043d\u0438 \u0431\u044b\u043b\u0438 \u0441\u0434\u0435\u043b\u0430\u043d\u044b, \u0438\u0437 \u043a\u043e\u0436\u0438 \u043b\u0438, \u0438\u0437 \u0431\u0443\u043c\u0430\u0433\u0438 \u043b\u0438, \u0438\u0437 \u0431\u0440\u043e\u043d\u0437\u044b \u0438\u043b\u0438 \u0437\u043e\u043b\u043e\u0442\u0430. \u041d\u0443, \u043b\u0435\u0433\u043a\u043e\u043c\u044b\u0441\u043b\u0435\u043d\u043d\u044b... \u043d\u0443, \u0447\u0442\u043e \u0436... \u0438 \u043c\u0438\u043b\u043e\u0441\u0435\u0440\u0434\u0438\u0435 \u0438\u043d\u043e\u0433\u0434\u0430 \u0441\u0442\u0443\u0447\u0438\u0442\u0441\u044f \u0432 \u0438\u0445 \u0441\u0435\u0440\u0434\u0446\u0430 ... \u043e\u0431\u044b\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044b\u0435 \u043b\u044e\u0434\u0438... \u0412 \u043e\u0431\u0449\u0435\u043c \u043d\u0430\u043f\u043e\u043c\u0438\u043d\u0430\u044e\u0442 \u043f\u0440\u0435\u0436\u043d\u0438\u0445... \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u043d\u044b\u0439 \u0432\u043e\u043f\u0440\u043e\u0441 \u0442\u043e\u043b\u044c\u043a\u043e \u0438\u0441\u043f\u043e\u0440\u0442\u0438\u043b \u0438\u0445 ...\xbb.\n                ",null,null,null,null,null)
B.Lb=new A.b8("                \u041a\u0430\u043d\u0442 \u0434\u0430\u043b \u0440\u0430\u0434\u0438\u043a\u0430\u043b\u044c\u043d\u043e \u0438\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435. \u041f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u2014 \u044d\u0442\u043e \u043d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u044d\u043f\u043e\u0445\u0430 \u0438 \u043d\u0435 \u043f\u0440\u043e\u0441\u0442\u043e \u0437\u043d\u0430\u043d\u0438\u0435. \u0421\u0442\u0430\u0442\u044c\u044f \xab\u041e\u0442\u0432\u0435\u0442 \u043d\u0430 \u0432\u043e\u043f\u0440\u043e\u0441: \u0427\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435?\xbb \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0432 \u043b\u0443\u0447\u0448\u0438\u0445 \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u044f\u0445 \u043a\u0430\u043d\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u0438\u0438 \u0441 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f: \xab\u041f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u2014 \u044d\u0442\u043e \u0432\u044b\u0445\u043e\u0434 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0438\u0437 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u043d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u044f, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u043d \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u043f\u043e \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u0438\u043d\u0435\xbb. \u041a\u0430\u0436\u0434\u043e\u0435 \u043f\u043e\u043d\u044f\u0442\u0438\u0435 \u0437\u0434\u0435\u0441\u044c \u0442\u0440\u0435\u0431\u0443\u0435\u0442 \u0440\u0430\u0437\u044a\u044f\u0441\u043d\u0435\u043d\u0438\u044f. \u041d\u043e \u0447\u0442\u043e \u0443\u0436\u0435 \u044f\u0441\u043d\u043e \u0438\u0437 \u044d\u0442\u043e\u0433\u043e \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u2014 \u044d\u0442\u043e \u0442\u043e, \u0447\u0442\u043e \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u043d\u0435 \u0441\u0442\u043e\u043b\u044c\u043a\u043e \u044d\u043f\u043e\u0445\u0430 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0436\u0438\u0437\u043d\u0438, \u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043d\u0430\u0448\u0435\u0439 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438. \u041a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u0432 \u044d\u0442\u043e\u043c \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0438 \u2014 \xab\u043d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u0435\xbb, \xab\u0432\u0438\u043d\u0430\xbb, \u2014 \u043d\u043e\u0441\u044f\u0442 \u043f\u043e\u0434\u0447\u0435\u0440\u043a\u043d\u0443\u0442\u043e \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u043d\u0443\u044e \u043e\u043a\u0440\u0430\u0441\u043a\u0443. \u042d\u0442\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u0435\u0442, \u0447\u0442\u043e \u043a\u0430\u0436\u0434\u044b\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0432 \u0441\u0432\u043e\u0435\u043c \u043b\u0438\u0447\u043d\u043e\u043c \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0438 \u0434\u043e\u043b\u0436\u0435\u043d \u043f\u0440\u043e\u0439\u0442\u0438 \u0447\u0435\u0440\u0435\u0437 \u044d\u0442\u043e \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435. \u0427\u0442\u043e \u0436\u0435 \u041a\u0430\u043d\u0442 \u0438\u043c\u0435\u0435\u0442 \u0432 \u0432\u0438\u0434\u0443 \u043f\u043e\u0434 \u043d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u0435\u043c \u0438 \u0432\u0438\u043d\u043e\u0439? \xab\u041d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u0435 \u2014 \u043d\u0435\u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u044c \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u0432\u043e\u0438\u043c \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u043e\u043c \u0431\u0435\u0437 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u0441\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u043a\u043e\u0433\u043e-\u043b\u0438\u0431\u043e \u0434\u0440\u0443\u0433\u043e\u0433\u043e. \u041d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u0438\u0435 \u043f\u043e \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u0438\u043d\u0435 \u2014 \u044d\u0442\u043e \u0442\u0430\u043a\u043e\u0435, \u043f\u0440\u0438\u0447\u0438\u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0437\u0430\u043a\u043b\u044e\u0447\u0430\u0435\u0442\u0441\u044f \u043d\u0435 \u0432 \u043d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043a\u0435 \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u0430, \u0430 \u0432 \u043d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043a\u0435 \u0440\u0435\u0448\u0438\u043c\u043e\u0441\u0442\u0438 \u0438 \u043c\u0443\u0436\u0435\u0441\u0442\u0432\u0430 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0438\u043c \u0431\u0435\u0437 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u043a\u0430\u043a\u043e\u0433\u043e-\u043b\u0438\u0431\u043e \u0434\u0440\u0443\u0433\u043e\u0433\u043e\xbb. \u041e\u0442\u0441\u044e\u0434\u0430 \u0441\u043b\u0435\u0434\u0443\u0435\u0442 \u0434\u0435\u0432\u0438\u0437 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f: \xabSapere aude! \u2014 \u0438\u043c\u0435\u0439 \u043c\u0443\u0436\u0435\u0441\u0442\u0432\u043e \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u043e\u043c!\xbb.\n                \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u0435\u0441\u043b\u0438 \u043c\u044b \u043e\u0431\u0432\u0438\u043d\u0438\u043b\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0432 \u043d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043a\u0435 \u043c\u0443\u0436\u0435\u0441\u0442\u0432\u0430, \u0442\u043e \u043a\u0440\u043e\u043c\u0435 \u043e\u0442\u0442\u0435\u043d\u043a\u0430 \u043c\u043e\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044f \u043d\u0435\u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u0432\u043e\u0437\u043d\u0438\u043a\u0430\u0435\u0442 \u0432\u043e\u043f\u0440\u043e\u0441: \u043a\u0430\u043a\u043e\u0432\u044b \u0436\u0435 \u043f\u0440\u0438\u0447\u0438\u043d\u044b \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u043b\u044e\u0434\u0438, \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u044b\u0435 \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0430\u0442\u044c\u0441\u044f \u0441\u0432\u043e\u0438\u043c \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0440\u0430\u0441\u0441\u0443\u0434\u043a\u043e\u043c, \u0442\u0435\u043c \u043d\u0435 \u043c\u0435\u043d\u0435\u0435, \u044d\u0442\u043e\u0433\u043e \u043d\u0435 \u0434\u0435\u043b\u0430\u044e\u0442, \u0441\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u044f \u0441\u0432\u043e\u0435 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u0432\u0441\u0435\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430? \xab\u041b\u0435\u043d\u043e\u0441\u0442\u044c \u0438 \u0442\u0440\u0443\u0441\u043e\u0441\u0442\u044c \u2014 \u0432\u043e\u0442 \u043f\u0440\u0438\u0447\u0438\u043d\u044b \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \u0441\u0442\u043e\u043b\u044c \u0431\u043e\u043b\u044c\u0448\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u043b\u044e\u0434\u0435\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043f\u0440\u0438\u0440\u043e\u0434\u0430 \u0443\u0436\u0435 \u0434\u0430\u0432\u043d\u043e \u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u043b\u0430 \u043e\u0442 \u0447\u0443\u0436\u043e\u0433\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0430, \u0432\u0441\u0435 \u0436\u0435 \u043e\u0445\u043e\u0442\u043d\u043e \u043e\u0441\u0442\u0430\u044e\u0442\u0441\u044f \u0432\u0441\u044e \u0436\u0438\u0437\u043d\u044c \u043d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u043d\u0438\u043c\u0438\u2026\xbb. \u041e\u043f\u044f\u0442\u044c \u043c\u044b \u0432\u0438\u0434\u0438\u043c, \u0447\u0442\u043e \u043f\u0440\u0438\u0447\u0438\u043d\u044b \u043d\u0435\u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043b\u044e\u0434\u0435\u0439 \u041a\u0430\u043d\u0442 \u0432\u0438\u0434\u0438\u0442 \u0432 \u0438\u0445 \u043b\u0438\u0447\u043d\u044b\u0445 \u0441\u0432\u043e\u0439\u0441\u0442\u0432\u0430\u0445. \u041f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u0435\u0441\u0442\u044c \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u043b\u0438\u0447\u043d\u043e\u0439 \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u2014 \u0442\u0430\u043a\u043e\u0432\u043e \u043e\u0441\u043d\u043e\u0432\u043d\u043e\u0435 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0438\u0438 \u041a\u0430\u043d\u0442\u0430. \u0414\u043b\u044f \u0442\u043e\u0433\u043e, \u0447\u0442\u043e\u0431\u044b \u043e\u0441\u0442\u0430\u0432\u0430\u0442\u044c\u0441\u044f \u0432 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438 \u043d\u0435\u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u043b\u044e\u0434\u0438 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u044e\u0442 \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0445 \u043f\u0440\u0438\u0435\u043c\u043e\u0432: \xab\u0415\u0441\u043b\u0438 \u0443 \u043c\u0435\u043d\u044f \u0435\u0441\u0442\u044c \u043a\u043d\u0438\u0433\u0430, \u043c\u044b\u0441\u043b\u044f\u0449\u0430\u044f \u0437\u0430 \u043c\u0435\u043d\u044f, \u0435\u0441\u043b\u0438 \u0443 \u043c\u0435\u043d\u044f \u0435\u0441\u0442\u044c \u0434\u0443\u0445\u043e\u0432\u043d\u044b\u0439 \u043f\u0430\u0441\u0442\u044b\u0440\u044c, \u0441\u043e\u0432\u0435\u0441\u0442\u044c \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043c\u043e\u0436\u0435\u0442 \u0437\u0430\u043c\u0435\u043d\u0438\u0442\u044c \u043c\u043e\u044e \u0438 \u0432\u0440\u0430\u0447, \u043f\u0440\u0435\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0449\u0438\u0439 \u043c\u043d\u0435 \u0442\u0430\u043a\u043e\u0439-\u0442\u043e \u043e\u0431\u0440\u0430\u0437 \u0436\u0438\u0437\u043d\u0438, \u0438 \u0442. \u043f. \u0442\u043e \u043c\u043d\u0435 \u043d\u0435\u0447\u0435\u0433\u043e \u0443\u0442\u0440\u0443\u0436\u0434\u0430\u0442\u044c \u0441\u0435\u0431\u044f. \u041c\u043d\u0435 \u043d\u0435\u0442 \u043d\u0430\u0434\u043e\u0431\u043d\u043e\u0441\u0442\u0438 \u043c\u044b\u0441\u043b\u0438\u0442\u044c, \u0435\u0441\u043b\u0438 \u044f \u0432 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438 \u043f\u043b\u0430\u0442\u0438\u0442\u044c\xbb.\n                \u0418\u043c\u0435\u043d\u043d\u043e \u0432 \u0441\u0438\u043b\u0443 \u043d\u0435\u0436\u0435\u043b\u0430\u043d\u0438\u044f \u0447\u0430\u0441\u0442\u0438 \u043b\u044e\u0434\u0435\u0439 \u043f\u0435\u0440\u0435\u0439\u0442\u0438 \u0432 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043f\u0440\u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u044f \u043f\u043e\u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0434\u0440\u0443\u0433\u0438\u0435 \u043b\u044e\u0434\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \xab\u043f\u0440\u0438\u0441\u0432\u0430\u0438\u0432\u0430\u044e\u0442 \u0441\u0435\u0431\u0435 \u043f\u0440\u0430\u0432\u043e \u0431\u044b\u0442\u044c \u0438\u0445 \u043e\u043f\u0435\u043a\u0443\u043d\u0430\u043c\u0438\xbb. \u041e\u043f\u0435\u043a\u0443\u043d\u044b \u0441\u0442\u0440\u0435\u043c\u044f\u0442\u0441\u044f, \u0447\u0442\u043e\u0431\u044b \u0438\u0445 \xab\u043f\u0430\u0441\u0442\u0432\u0430\xbb \u043d\u0435 \u043c\u043e\u0433\u043b\u0430 \u0441\u0434\u0435\u043b\u0430\u0442\u044c \u043d\u0438 \u0448\u0430\u0433\u0443 \u0431\u0435\u0437 \u043f\u043e\u043c\u043e\u0447\u0435\u0439, \u0430 \u043f\u043e\u0441\u043b\u0435 \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u043d\u0430 \u0433\u0440\u043e\u0437\u044f\u0449\u0443\u044e \u0438\u043c \u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u044c \u043e\u0442 \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044f.\n                ",null,null,null,null,null)
